(1, '02-02-231675333501501415846.jpg', 'شنيور 12 فولت 1 بطاريه 1.5 امبير ECDL12511', 'Lithium-Ion cordless drill', '<p>الجهد: 12 فولت<br />سرعة عدم التحميل: 0-750 دورة في الدقيقة<br />أقصى عزم: 20 نيوتن متر<br />قدرة تشاك: 0.8-10 مم<br />إعدادات عزم الدوران: 15 + 1<br />فولتات الشحن: 220 فولت -240 فولت ~ 50/60 هرتز<br />ضوء عمل متكامل<br />مع 1 قطعة حزمة بطارية 1.5Ah<br />مع شاحن 1 قطعة<br />مع 2 قطعة Cr-V 65 مللي متر بت<br />معبأة بواسطة مربع اللون</p>', '<p>Voltage:12V<br />No-load speed:0-750rpm<br />Max.torque:20NM<br />Chuck capacity:0.8-10mm<br />Torque settings:15+1<br />Charge volts:220V-240V~50/60Hz&nbsp;<br />Integrated work light<br />With 1pcs 1.5Ah battery pack<br />With 1pcs charger<br />With 2pcs Cr-V 65mm bits<br />Packed by color box</p>', 1250.00, 1024.24, 890.64, 19, 56.00, 0.00, '2022-08-07 12:35:17', '2023-12-15 22:13:01'),
(2, '02-02-2316753334861271110421.jpg', 'شنيور 12 فولت 2 بطاريه 1.5 امبير شنطه بلاستيك ECDL12622', 'Lithium-ion cordless drill', '<p>الجهد: 12 فولت<br />سرعة عدم التحميل: 0-400 / 0-1500 / دقيقة<br />أقصى عزم: 45 نيوتن متر<br />قدرة تشاك: 0.8-10 مم<br />655 موتور<br />إعدادات عزم الدوران: 15 + 1<br />ترس ميكانيكي 2 سرعات<br />فولتات الشحن: 220 فولت -240 فولت ~ 50/60 هرتز<br />ضوء عمل متكامل<br />مع 2 قطعة بطارية 1.5Ah<br />مع شاحن 1 قطعة<br />مع 2 قطعة Cr-V 65 مللي متر بت<br />معبأة بصندوق بلاستيكي</p>', '<p>Voltage:12V<br />No-load speed:0-400/0-1500/min<br />Max.torque:45NM<br />Chuck capacity:0.8-10mm<br />655 Motor<br />Torque settings:15+1<br />Mechanical 2-speed gear<br />Charge volts:220V-240V~50/60Hz&nbsp;<br />Integrated work light<br />With 2pcs 1.5Ah battery pack<br />With 1pcs charger<br />With 2pcs Cr-V 65mm bits<br />Packed by plastic box</p>', 2100.00, 2011.37, 1749.02, 0, 9.00, 0.00, '2022-08-07 12:41:44', '2023-12-28 13:38:44'),
(3, '02-02-2316753334751996455225.jpg', 'شنيور 12 فولت دقاق ليثيوم 2 بطاريه شنطه بلاستيك + اكسسوار  ECIDL12622', 'Lithium-Ion impact drill', '<p>الجهد: 12 فولت<br />سرعة عدم التحميل: 0-400 / 0-1500 / دقيقة<br />معدل التأثير الأقصى: 22500 / دقيقة<br />العزم الأقصى: 45 نيوتن متر<br />قدرة تشاك: 0.8-10 مم<br />655 موتور<br />إعدادات عزم الدوران: 18 + 1 + 1<br />ترس ميكانيكي 2 سرعات<br />فولتات الشحن: 220 فولت -240 فولت ~ 50/60 هرتز<br />ضوء عمل متكامل<br />مع 2 قطعة بطارية 1.5Ah<br />مع شاحن 1 قطعة<br />مع 50 قطعة من الملحقات<br />معبأة بصندوق بلاستيكي</p>', '<p>Voltage:12V<br />No-load speed:0-400/0-1500/min<br />Max impact rate:22500/min<br />Max torque:45NM<br />Chuck capacity:0.8-10mm<br />655 Motor<br />Torque settings:18+1+1<br />Mechanical 2-speed gear<br />Charge volts:220V-240V~50/60Hz&nbsp;<br />Integrated work light<br />With 2pcs 1.5Ah battery pack<br />With 1pcs charger<br />With 50pcs accessories<br />Packed by plastic box</p>', 2300.00, 2210.93, 1922.55, 12, 39.00, 4.00, '2022-08-07 12:43:40', '2023-12-23 18:30:17'),
(7, '02-02-231675346974373791932.jpg', 'بطارية 12 فولت 1.5 امبير قلم ليثيوم EBPK12150', 'Lithium-Ion battery pack', '<p>Voltage:12V<br />Lithium-ion 1.5Ah battery<br />One battery fits all S12 multiple tools<br />Packed by color box</p>', '<p>Voltage:12V<br />Lithium-ion 1.5Ah battery<br />One battery fits all S12 multiple tools<br />Packed by color box</p>', 600.00, 546.04, 474.82, 5, 10.00, 0.00, '2022-09-02 22:29:09', '2023-12-28 13:40:43'),
(9, '02-02-2316753334541957148067.jpg', 'مسدس شمع  12 فولت بدون البطاريه والشاحن ELGG1201', 'Lithium-ion glue gun', '<p>الجهد: 12 فولت<br />قدرة اللصق: 15-18 جم / دقيقة<br />قطر عصا الغراء: 11.2 مللي متر<br />مع 3 قطع 150 مللي متر عصي غراء<br />لا بطارية وشاحن مدرجين<br />معبأة بواسطة نفطة مزدوجة</p>', '<p>Voltage:12V<br />Gluing capacity:15-18g/min<br />Glue stick diameter:11.2mm<br />With 3 pcs 150mm glue sticks<br />NO battery and charger included<br />Packed by double blister</p>', 500.00, 395.81, 344.18, 40, 5.00, 0.00, '2022-09-02 22:32:41', '2023-11-16 14:28:22'),
(10, '02-02-231675346901751125579.jpg', 'شنيور 20 فولت 1.5 امبير 1 بطارية بدون شنطة ECDL620011', 'Lithium-ion cordless drill', '<p>Voltage:20V<br />No-load speed:0-400/0-1500/min<br />Max torque:45NM<br />Chuck capacity:0.8-10mm<br />Torque settings:15+1<br />Mechanical 2-speed gear<br />With 1pcs 1.5Ah battery pack<br />With 1pcs charger<br />Charge volts:220V-240V~50/60Hz&nbsp;<br />Integrated work light<br />LED battery power indicator<br />Packed by color box</p>', '<p>Voltage:20V<br />No-load speed:0-400/0-1500/min<br />Max torque:45NM<br />Chuck capacity:0.8-10mm<br />Torque settings:15+1<br />Mechanical 2-speed gear<br />With 1pcs 1.5Ah battery pack<br />With 1pcs charger<br />Charge volts:220V-240V~50/60Hz&nbsp;<br />Integrated work light<br />LED battery power indicator<br />Packed by color box</p>', 2150.00, 1956.85, 1701.61, 62, 22.00, 0.00, '2022-09-02 22:39:13', '2023-12-09 12:07:25'),
(11, '02-02-231675346883779011962.jpg', 'شنيور 20 فولت 1.5 امبير 2 بطارية ECDL620012', 'Lithium-ion cordless drill', '<p>الجهد: 20 فولت سرعة عدم التحميل: 0-400 / 0-1500 / دقيقة العزم الأقصى: 45 ​​نيوتن متر قدرة تشاك: 0.8-10 مم إعدادات عزم الدوران: 15 + 1 ترس ميكانيكي 2 سرعات فولتات الشحن: 220V-240V ~ 50 / 60Hz مع 2 قطعة بطارية 1.5Ah مع شاحن 1 قطعة مع 47 قطعة من الملحقات ضوء عمل متكامل مؤشر طاقة البطارية LED معبأة بصندوق بلاستيكي</p>', '<p>Voltage:20V<br />No-load speed:0-400/0-1500/min<br />Max torque:45NM<br />Chuck capacity:0.8-10mm<br />Torque settings:15+1<br />Mechanical 2-speed gear<br />Charge volts:220V-240V~50/60Hz&nbsp;<br />With 2pcs 1.5Ah battery pack<br />With 1pcs charger<br />With 47pcs &nbsp;accessories<br />Integrated work light<br />LED battery power indicator<br />Packed by plastic box</p>', 2900.00, 2570.24, 2234.99, 59, 4.00, 0.00, '2022-09-02 22:56:05', '2023-12-03 14:07:39'),
(12, '02-02-231675333419225898749.jpg', 'شنيور 20 فولت 2 امبير 2 بطاريه دقاق ECIDL620012', 'Lithium-ion impact drill', '<p>الجهد: 20 فولت<br />سرعة عدم التحميل: 0-400 / 0-1500 / دقيقة<br />العزم الأقصى: 45 ​​نيوتن متر<br />قدرة تشاك: 0.8-10 مم<br />إعدادات عزم الدوران: 18 + 1 + 1<br />ترس ميكانيكي 2 سرعات<br />فولتات الشحن: 220V-240V ~ 50 / 60Hz<br />مع 2 قطعة حزمة بطارية 2.0Ah<br />مع شاحن 1 قطعة<br />مع 47 قطعة من الملحقات<br />ضوء عمل متكامل<br />مؤشر طاقة البطارية LED<br />معبأة بصندوق بلاستيكي</p>', '<p>Voltage:20V<br />No-load speed:0-400/0-1500/min<br />Max torque:45NM<br />Chuck capacity:0.8-10mm<br />Torque settings:18+1+1<br />Mechanical 2-speed gear<br />Charge volts:220V-240V~50/60Hz&nbsp;<br />With 2pcs 2.0Ah battery pack<br />With 1pcs charger<br />With 47pcs &nbsp;accessories<br />Integrated work light<br />LED battery power indicator<br />Packed by plastic box</p>', 3150.00, 2578.00, 2241.50, 1, 29.00, 0.00, '2022-09-02 22:58:18', '2023-12-31 12:45:35'),
(13, '09-11-231699534758775503418.jpg', 'دريل 1/2 بوصه موتور بروشليس 2 بطاريه + شنطه قماش ECDLIW20221', 'Lithium-Ion impact wrench', '<p>فرش السيارات<br />الجهد: 20 فولت<br />محرك مربع: 1/2 &quot;<br />سرعة عدم التحميل: 0-1300 / 0-2100 نبضة في الدقيقة<br />معدل التأثير: 0-2000 / 0-3300 نبضة في الدقيقة<br />ماكس عزم الدوران: 300 نيوتن متر<br />مع 2 قطعة حزمة بطارية 2.0Ah<br />مع شاحن 1 قطعة<br />فولتات الشحن: 220V-240V ~ 50 / 60Hz<br />ضوء عمل متكامل<br />مؤشر طاقة البطارية LED<br />مع مقابس 3 قطعة (17 19 21 مم)<br />معبأة في كيس قماش</p>', '<p>Brushless Motor<br />Voltage:20V<br />Square Drive:1/2&quot;<br />No-load speed:0-1300/0-2100bpm<br />Impact rate:0-2000/0-3300bpm<br />Max torque:300NM<br />With 2pcs 2.0Ah battery pack<br />With 1pcs charger<br />Charge volts:220V-240V~50/60Hz&nbsp;<br />Integrated work light<br />LED battery power indicator<br />With 3pcs sockets(17 19 21mm)<br />Packed by canvas bag</p>', 4000.00, 3489.46, 3034.31, 13, 62.00, 0.00, '2022-09-02 22:59:42', '2024-01-01 10:28:04'),
(14, '02-02-231675333362634347710.jpg', 'دريل 1/4 بوصة موتور بروشليس 2 بطاريه + شنطه قماش ECDLIR20221', 'Lithium-ion impact driver', '<p>فرش السيارات<br />جهد الحفر: 20 فولت<br />عرقوب سداسية: 1/4 بوصة<br />سرعة عدم التحميل: 0-1300 / 0-2100 / دقيقة<br />معدل التأثير: 0-2000 / 0-3300 نبضة في الدقيقة<br />العزم الأقصى: 170 نيوتن متر<br />مع 2 قطعة حزمة بطارية 2.0Ah<br />مع شاحن 1 قطعة<br />فولتات الشحن: 220V-240V ~ 50 / 60Hz<br />ضوء عمل متكامل<br />مؤشر طاقة البطارية LED<br />مع 2 قطع مفك البراغي بت<br />مع 3 قطع مثبتات الجوز<br />معبأة في كيس قماش</p>', '<p>Brushless Motor<br />Drill voltage:20V<br />Hex shank:1/4&quot;<br />No-load speed:0-1300/0-2100/min<br />Impact rate:0-2000/0-3300bpm<br />Max torque:170NM<br />With 2pcs 2.0Ah battery pack<br />With 1pcs charger<br />Charge volts:220V-240V~50/60Hz&nbsp;<br />Integrated work light<br />LED battery power indicator<br />With 2pcs screwdriver bits<br />With 3pcs nut setters<br />Packed by canvas bag</p>', 4250.00, 3462.90, 3011.22, 40, 15.00, 0.00, '2022-09-02 23:01:42', '2023-12-28 11:19:22'),
(17, '02-02-231675346852854926169.jpg', 'بطارية 20 فولت 2 أمبير لثيوم EBPK20011', 'Lithium-ion battery pack', '<p>الجهد: 20 فولت بطارية ليثيوم أيون 2.0Ah مؤشر طاقة البطارية LED بطارية واحدة تناسب جميع أدوات P20S المتعددة معبأة بواسطة مربع اللون</p>', '<p>Voltage:20V<br />Lithium-ion 2.0Ah battery<br />LED battery power indicator<br />One battery fits all P20S multiple tools<br />Packed by color box</p>', 750.00, 686.24, 596.73, 72, 18.00, 0.00, '2022-09-03 00:37:04', '2023-11-24 10:57:10'),
