(87, '02-02-231675343197222853319.jpg', 'مسدس دوكو 450 وات ESGN35001', 'Spray gun', '<p>الجهد: 220-240 فولت ~ 50/60 هرتز<br />مدخلات الطاقة: 450 واط<br />ضغط الرش: 0.1-0.2 بار<br />أقصى تدفق: 380 مل / دقيقة<br />الأعلى. اللزوجة: 50DIN-s<br />سعة الحاوية: 800 مل<br />مُكَمِّلات:<br />كوب قياس اللزوجة 1x<br />1x فوهة تنظيف إبرة</p>', '<p>Voltage:220-240V~50/60Hz<br />Input power:450W<br />Spraying Pressure:0.1-0.2Bar<br />Max flow:380ml/min<br />Max. viscosity:50DIN-s<br />Container capacity:800ml<br />Accessories:<br />1x viscosity measuring cup<br />1x nozzle cleaning needle</p>', 1000.00, 910.86, 792.05, 0, 40.00, 0.00, '2022-09-03 19:40:02', '2023-12-30 11:56:00'),
(89, '02-02-231675343228847774823.jpg', 'مسدس شمع 100 وات EGGU1401', 'Glue gun', '<p>فولت: 220-240 فولت ~ 50/60 هرتز مدخلات الطاقة: 20 واط (100 واط) قدرة اللصق: 13-18 جم / دقيقة قطر عصا الغراء: 11.2 مللي متر مثالي للملحقات اللاصقة ، وصنع النماذج ، والإصلاح ، والختم ، والربط نظام تغذية ميكانيكي للقياس الحساس والتطبيق السريع مع 2 قطعة 150 مللي متر عصي غراء معبأة بواسطة نفطة مزدوجة</p>', '<p>Volts:220-240V~50/60Hz<br />Input power:20W(100W)<br />Gluing capacity:13-18g/min<br />Glue stick diameter:11.2mm<br />Ideal for adhesive attachment, model making, repairing, sealing and jointing<br />Mechanical feed system for sensitive metering and rapid application<br />With 2 pcs 150mm glue sticks<br />Packed by double blister</p>', 350.00, 215.25, 187.17, 192, 58.00, 0.00, '2022-09-03 19:42:42', '2023-12-30 11:09:56'),
(91, '02-02-2316753326131145395288.jpg', 'طقم شمع 6 قطع 20 سم EGGS20601', 'Glue gun stick', '<p>مادة ： راتنج البترول القطر: 11.2 ملم الطول ： 20 سم مع عصا 6 قطع معبأة ببطاقة نفطة</p>', '<p>Material：petroleum resin<br />Diameter:11.2mm<br />Length：20cm<br />With 6 pcs stick<br />Packed by blister card</p>', 95.00, 71.77, 55.21, 30, 11.00, 0.00, '2022-09-03 19:44:52', '2023-12-30 11:13:22'),
(94, '27-04-231682586859953996597.jpeg', 'بلاور شفط و طرد 600 وات EABR6001', 'Aspirator blowe', '<p>الجهد: 220-240 فولت ~ 50/60 هرتز<br />مدخلات الطاقة: 600 واط<br />سرعة عدم التحميل: 0-16000 دورة في الدقيقة<br />معدل النفخ: 0-3.5m&sup3; / min<br />التحكم في السرعة المتغيرة<br />مع كيس غبار 1 قطعة<br />معبأة بواسطة مربع اللون</p>', '<p>Voltage: 220-240V~50/60Hz<br />Input power:600W<br />No-load speed:0-16000rpm<br />Blowing rate:0-3.5m&sup3;/min<br />Variable speed control<br />With 1pcs dust bag<br />Packed by color box</p>', 1250.00, 934.38, 812.50, 54, 10.00, 0.00, '2022-09-03 19:47:33', '2023-12-14 01:57:26'),
(95, '02-02-231675343132595421543.jpg', 'بلاور شفط و طرد 800 وات + ملحقات مكنسة EABR8001', 'Aspirator blower', '<p>الجهد: 220 فولت -240 فولت ~ 50/60 هرتز مدخلات الطاقة: 800 واط سرعة عدم التحميل: 0-15000 دورة في الدقيقة معدل النفخ الأقصى: 0-4.5m3 / دقيقة متغيرة السرعة مع مجموعة واحدة من فرش الكربون الإضافية مع كيس غبار 1 قطعة مع أنبوب مرن 1 قطعة مع فتحات شفط 2 قطعة معبأة بواسطة مربع اللون</p>', '<p>Voltage: 220V-240V~50/60Hz<br />Input power:800W<br />No-load speed:0-15000rpm<br />Max blowing rate:0-4.5m3/min<br />Variable speed<br />With 1set extra carbon brushes<br />With 1pcs dust bag<br />With 1pcs flexible tube<br />With 2pcs suction nozzles<br />Packed by color box</p>', 1800.00, 1691.24, 1470.64, 79, 10.00, 0.00, '2022-09-03 19:48:21', '2023-12-30 12:13:22'),
(96, '02-02-231675342631684785194.jpg', 'حفار كور 2800 وات EDDM280020', 'Diamond drilling machine', '<p>الجهد: 220-240 فولت ~ 50/60 هرتز مدخلات الطاقة: 2800 واط سرعة عدم التحميل: 800 دورة في الدقيقة الأعلى. قطر الحفر: 200mm خيط المغزل: M22.5 مع منصة حفر مع مجموعة واحدة من فرش الكربون الإضافية مع مفتاح حماية التسرب معبأة في علبة كرتون</p>', '<p>Voltage:220-240V~50/60Hz<br />Input power:2800W<br />No-load speed:800rpm<br />Max. drilling diameter:200mm<br />Spindle thread:M22<br />With drilling stand<br />With 1set extra carbon brushes<br />With leakage protection switch<br />Packed by carton box</p>', 10000.00, 8981.93, 7810.37, 23, 9.00, 0.00, '2022-09-03 19:49:17', '2023-12-30 12:01:40'),
(97, '02-02-231675332572925931435.jpg', 'ماكينة لحام مواسير بولي 1500 وات  EPTW15001', 'plastic tube welding tools', '<p>الجهد: 220 فولت -240 فولت ~ 50/60 هرتز<br />الطاقة المقدرة: 800W / 1500W<br />قطر اللحام: 20-63 مللي متر<br />درجة حرارة العمل: 0-300 درجة مئوية<br />ينطبق على: PP-R ، PB ، PE ، PE-RT<br />مع 6 مآخذ لحام: 20 ، 25 ، 32 ، 40 ، 50 ، 63 ملم<br />مع قطع الأنابيب 1 قطعة<br />مع مفك البراغي 1 قطعة<br />مع 1 قطعة الشريط<br />مع 1 قطعة مفتاح عرافة<br />معبأة بصندوق معدني</p>', '<p>Voltage:220V-240V~50/60Hz<br />Rated power:800W/1500W<br />Welding diameter:20-63mm<br />Working temperature:0-300℃<br />Applying to:PP-R,PB,PE,PE-RT<br />With 6pcs welding sockets:20,25,32,40,50,63mm<br />With 1pcs pipe cutter<br />With 1pcs screwdriver<br />With 1pcs tape<br />With 1pcs hex key<br />Packed by metal box</p>', 2500.00, 2146.96, 1866.92, 1, 4.00, 0.00, '2022-09-03 19:50:06', '2023-12-30 12:04:42'),
(99, '02-02-231675342563739393898.jpg', 'مثقاب 350 وات 13 مللي EDPS01301', 'Drill press', '<p>الجهد: 220-240 فولت ~ 50 هرتز مدخلات الطاقة: 350 واط سرعة عدم التحميل: 580-2650 دورة في الدقيقة قدرة الحفر القصوى: 13 مللي متر طاولة عمل قابلة للتعديل إعدادات سرعة المغزل: 5 سفر المغزل: 50 مللي متر قطر العمود: 46 مم حجم الجدول: 160mmx160mm</p>', '<p>Voltage:220-240V~50Hz<br />Input power:350W<br />No-load speed:580-2650rpm<br />Max.drilling capacity:13mm<br />Adjustable working table<br />Spindle speed settings:5<br />Spindle travel:50mm<br />Column diameter:46mm<br />Table size:160mmx160mm</p>', 3850.00, 3698.81, 3216.36, 10, 22.00, 0.00, '2022-09-03 19:52:26', '2023-12-30 12:20:46'),
(100, '02-02-2316753325541180349254.jpg', 'ديسك قطعيه خشابي 1400 وات 8.25 بوصه خدمه شاقه EMSW14001', 'Mitre saw', '<p>الجهد: 220-240 فولت ~ 50/60 هرتز<br />مدخلات الطاقة: 1400 واط<br />سرعة عدم التحميل: 5000 دورة في الدقيقة<br />حجم الشفرة: 210mmx25.4mm<br />قدرة القطع القصوى: 55mmx120mm<br />ميتري يقطع 0-45 درجة اليسار واليمين<br />قطع شطبة تصل إلى 45 درجة إلى اليسار<br />مع مجموعة واحدة من فرش الكربون الإضافية<br />مع 1 قطعة شفرة TCT<br />مع كيس غبار 1 قطعة<br />معبأة بواسطة مربع اللون</p>', '<p>Voltage:220-240V~50/60Hz<br />Input power:1400W<br />No-load speed:5000rpm<br />Blade size:210mmx25.4mm<br />Max.cutting capacity:55mmx120mm<br />Mitre cuts 0-45&deg;left and right<br />Bevel cuts up to 45&deg;to the left<br />With 1set extra carbon brushes<br />With 1pcs TCT blade<br />With 1pcs dust bag<br />Packed by color box</p>', 3450.00, 3263.82, 2838.10, 0, 11.00, 0.00, '2022-09-03 19:53:29', '2023-12-30 12:16:02'),
(103, '02-02-2316753325401316947581.jpg', 'ديسك قطعيه حدادي 2350 وات 14 بوصه  ECFS3551', 'Cut off saw', '<p>الجهد: 220-240 فولت ~ 50/60 هرتز<br />مدخلات الطاقة: 2350 واط<br />حجم الشفرة: 355 مم &times; 25.4 مم<br />سرعة عدم التحميل: 3800 دورة في الدقيقة<br />قدرة القطع القصوى:<br />100 مم في أنبوب دائري<br />100 مم &times; 100 مم من الفولاذ المربع<br />120mmx100mm في مستطيل<br />Max.cutting شريط فولاذي: 50mm<br />مع مجموعة واحدة من فرش الكربون الإضافية<br />مع 1 قطعة 355 مللي متر قرص القطع<br />معبأة بواسطة مربع اللون</p>', '<p>Voltage:220-240V~50/60Hz<br />Input power:2350W<br />Blade size:355mmx25.4mm<br />No-load speed:3800rpm<br />Max.cutting capacity:<br />100mm in round pipe<br />100mmx100mm in square steel<br />120mmx100mm in rectangle<br />Max.cutting steel bar:50mm<br />With 1set extra carbon brushes<br />With 1pcs 355mm cutting disc<br />Packed by color box</p>', 4800.00, 4672.98, 4063.46, 5, 9.00, 0.00, '2022-09-03 19:56:00', '2023-12-30 12:17:49'),
