(108, '02-02-2316753425391960173963.jpg', 'مولد كهرباء ديزل 5 كيلو وات خارج 4.5 كيلو وات 9 حصان صامت EDGRS511', 'Silent diesel generator', '<p>الفولطية المقدرة (V): 220-240 التردد المقدر (هرتز): 50 المرحلة: مفرد Max.output (kW): 5.0 الإخراج المقدر (كيلوواط): 4.5 السرعة المقدرة (دورة في الدقيقة): 3000 خرج التيار المستمر: 12 فولت ، 8.3 أمبير المحرك: ديزل 9.0 حصان النزوح (مل): 418 نظام التبريد: تبريد الهواء نظام البدء: كهربائي مولد التيار المتردد لفائف النحاس خزان الوقود (L): 17 الوزن الجاف (كجم): 152 بطارية لا تحتاج إلى صيانة 30 أمبير مولد ديزل من النوع الصامت</p>', '<p>Rated voltage(V):220-240<br />Rated frequency(Hz):50<br />Phase:Single<br />Max.output(kW):5.0<br />Rated output(kW):4.5<br />Rated speed(rpm):3000<br />DC output:12V,8.3A<br />Engine:Diesel 9.0HP<br />Displacement(ml):418<br />Cooling system:Air-cooled<br />Starting system:Electric<br />Copper coil alternator<br />Fuel tank(L):17<br />Dry weight(Kg):152<br />30AH maintenance-free battery<br />Silent type diesel generator<br />Packed by carton box</p>', 50000.00, 49254.20, 42829.74, 3, 4.00, 0.00, '2022-09-04 18:34:10', '2023-12-30 12:36:38'),
(112, '02-02-2316753425252028791156.jpg', 'موتور مياه 3/4 حصان 550 وات ملفات نحاس EWPPV05501', 'Water pump', '<p>Peripheral Pump<br />Voltage:220-240V~50Hz<br />Rated power:550W(0.75HP)<br />Max.head:45m<br />Max.flow:45L/min<br />Max.suction:8m<br />Pipe diameter:1&quot;x1&quot;<br />Copper wire motor<br />Brass impeller<br />0.3m length cable<br />Packed by carton box</p>', '<p>Peripheral Pump<br />Voltage:220-240V~50Hz<br />Rated power:550W(0.75HP)<br />Max.head:45m<br />Max.flow:45L/min<br />Max.suction:8m<br />Pipe diameter:1&quot;x1&quot;<br />Copper wire motor<br />Brass impeller<br />0.3m length cable<br />Packed by carton box</p>', 2500.00, 2351.58, 2044.85, 0, 19.00, 0.00, '2022-09-04 18:41:49', '2023-12-30 12:43:02');
