(114, '02-02-2316753324611857740164.jpg', 'موتور 1 حصان 750 وات  ملفات نحاس (تحضير ذاتي) EWPPJ07501', 'Water pump', '<p>مضخة نفاثة ذاتية التحضير<br />الجهد: 220-240 فولت ~ 50 هرتز<br />الطاقة المقدرة: 750 واط (1.0 حصان)<br />Max.head: 51m<br />التدفق الأقصى: 55 لتر / دقيقة<br />ماكس الامتصاص: 9 م<br />قطر الأنبوب: 1 &quot;&times; 1&quot;<br />محرك سلك نحاسي<br />المكره الفولاذ المقاوم للصدأ<br />كابل بطول 0.3 متر<br />معبأة في علبة كرتون</p><p>&nbsp;</p>', '<p>Self-priming Jet Pump<br />Voltage:220-240V~50Hz<br />Rated power:750W(1.0HP)<br />Max.head:51m<br />Max.flow:55L/min<br />Max.suction:9m<br />Pipe diameter:1&quot;x1&quot;<br />Copper wire motor<br />Stainless steel impeller<br />0.3m length cable<br />Packed by carton box</p>', 3800.00, 3637.78, 3163.29, 15, 17.00, 0.00, '2022-09-04 18:44:05', '2023-12-30 12:47:50'),
