(370, '23-01-23167448352261803708.jpg', 'تكييف فريش تربو 1.5 حصان بارد ديجيتال', 'Fresh Turbo Air Conditioner 1.5 HP Cooling Digital', '<p>يتميز تكييف فريش بالعديد من الخصائص الرائعة مثل خاصية&nbsp;<strong>التتبع</strong>&nbsp;التي تعمل على وجود سينسور بالريموت مما يتيح له قياس درجه الحراره المحيطه للريموت و ارسالها الي التكييف ليقوم بضبط أفضل درجة تبريد للمكان.<br />استمتع أيضاً بخاصية&nbsp;<strong>التشغيل الاقتصادي عند النوم</strong>&nbsp;التي تقوم بتوفير أكبر قدر من الطاقة و اعطاء اكبر قدر من الراحة أثناء النوم.<br />يتميز هذا التكييف من فريش بفريون&nbsp;<strong>R410A&nbsp;&nbsp;</strong>وهو فريون صديق للبيئة.<br />أحد خصائص تكييف فريش الأخري الرائعه أنه يعمل على<strong>&nbsp;اقل ضغط للكهرباء</strong>&nbsp;مما يوفر فى استهلاك الكهرباء بصورة كبيرة للغاية وهي أحد أكبر مميزات تكييفات فريش.<br />اشتري تكييف فريش للحصول على جو بارد ورائع للتغلب على حر الصيف.</p>', '<p>Fresh Turbo Air Conditioner 1.5 HP Cooling Digital</p>', 18000.00, 17629.00, 17629.00, 0, 50.00, 0.00, '2022-09-11 11:34:35', '2023-12-02 11:07:36'),
