(384, '05-11-2216676549491689003102.jpg', 'تكييف فريش بريمير تربو 4 حصان بارد ساخن بلازما ديجيتال', 'Fresh Premier Turbo Air Conditioner 4 HP Cooling Heating Plasma Digital', '<p>4 قوة حصان (بارد/ساخن&nbsp;).</p><p>كفاءة أعلى واستهلاك أقل للكهرباء.</p><p>فريون R410 صديقة للبيئة.</p><p>خاصية النوم: التشغيل الاقتصادي أثناء النوم.</p><p>خاصية&nbsp;التتبع: حساس اضافي في&nbsp;الريموت لاداء افضل.</p><p>يعمل باقل جهد كهرباء</p><p>المكونات الداخلية مدهونة بطلاء ذهبي لحماية اطول</p><p>امكانية التنظيف الذاتي.</p><p>شاشة عرض LED.</p><p>الحماية الذاتية عند إعادة التشغيل عدة مرات.</p><p>التشخيص الذاتي: تحديد موقع الخطأ تلقائيًا في الجهاز.</p><p>الوحدة الخارجية معالجة&nbsp;ضد الصدأ.</p><p>خاصية توربو للتبريد السريع.</p><p>خاصية&nbsp;التشغيل التلقائي للجهاز عند عودة الطاقة</p><p>&nbsp;</p>', '<p>Commercial Name &nbsp;Premier Turbo - P</p><p>Capacity 4H</p><p>Cool/Heat HP</p>', 55000.00, 53549.00, 53549.00, 0, 0.00, 0.00, '2022-09-11 11:56:13', '2023-12-02 12:34:38'),
(385, '05-11-2216676549671807106524.jpg', 'تكييف فريش بريمير تربو 5 حصان بارد ساخن بلازما ديجيتال', 'Fresh Air Conditioner Premier Turbo 5 HP Cooling Heating Plasma Digital', '<p>5 قوة حصان (بارد/ساخن&nbsp;).</p><p>كفاءة أعلى واستهلاك أقل للكهرباء.</p><p>فريون R410 صديقة للبيئة.</p><p>خاصية النوم: التشغيل الاقتصادي أثناء النوم.</p><p>خاصية&nbsp;التتبع: حساس اضافي في&nbsp;الريموت لاداء افضل.</p><p>يعمل باقل جهد كهرباء</p><p>المكونات الداخلية مدهونة بطلاء ذهبي لحماية اطول</p><p>امكانية التنظيف الذاتي.</p><p>شاشة عرض LED.</p><p>الحماية الذاتية عند إعادة التشغيل عدة مرات.</p><p>التشخيص الذاتي: تحديد موقع الخطأ تلقائيًا في الجهاز.</p><p>الوحدة الخارجية معالجة&nbsp;ضد الصدأ.</p><p>خاصية توربو للتبريد السريع.</p><p>خاصية&nbsp;التشغيل التلقائي للجهاز عند عودة الطاقة</p>', '<p>Commercial Name &nbsp;Premier Turbo - P</p><p>Capacity 5H</p><p>Cool/Heat HP<br />&nbsp;</p>', 63000.00, 61599.00, 61599.00, 0, 0.00, 0.00, '2022-09-11 11:57:10', '2023-11-28 12:16:04'),
(386, '05-02-2316756027231211721141.jpg', 'ستارة هواء فريش ماجيك 120سم', 'Fresh Magic Air Curtain 120cm', '<p>- المقاسات&nbsp;<strong>120 سم</strong>.</p><p>-&nbsp;<strong>مستويان للسرعة</strong>&nbsp;مع إمكانية ضبط شفرات مخرج الهواء.<br />- عزل جو المكان عن الخارج مما يوفر بيئة صحية.</p><p>- امكانية التحكم عن طريق&nbsp;<strong>الريموت</strong>&nbsp;او بدون جهاز التحكم.</p><p>- سهولة التركيب والتعليق - الحفاظ على الجو بارد داخل المبنى بالرغم من ارتفاع درجة الحرارة.</p><p>- يمنع الحشرات والغبار من دخول المكان.</p><p>- يمنع الرطوبة ومياه الأمطار من الدخول.</p><p>- توفير استهلاك الكهرباء في التكييف. - ستارة الهواء يمكن أن تمنع الروائح الكريهة والأبخرة وعوادم السيارات. -</p><p>يعمل بأقل جهد كهربي. - التأثير الإيجابي على بيئة العمل في المنزل.</p><p>- ضمان سنتين.<br />- الحماية الذاتية عند إعادة التشغيل عدة مرات.</p><p>- أماكن الاستخدام (مستشفيات - مطاعم - فنادق - مكاتب - سوبر ماركت - أماكن صناعية - مولات تجارية).</p><p>- الوحدة الخارجية ضد الصدأ.</p><p>- نظام توربو للتبريد السريع.</p><p>- التشغيل التلقائي للجهاز عند عودة التيار</p>', '<p>Fresh Magic Air Curtain 120cm</p>', 7000.00, 6759.00, 6759.00, 0, 0.00, 0.00, '2022-09-11 12:02:50', '2023-12-02 11:14:00'),
(387, '05-02-2316756027901312133955.jpg', 'ستارة هواء فريش ماجيك 90سم', 'Fresh Magic Air Curtain 90cm', '<p>- المقاسات&nbsp;<strong>90 سم</strong>.</p><p>-&nbsp;<strong>مستويان للسرعة</strong>&nbsp;مع إمكانية ضبط شفرات مخرج الهواء.<br />- عزل جو المكان عن الخارج مما يوفر بيئة صحية.</p><p>- امكانية التحكم عن طريق&nbsp;<strong>الريموت</strong>&nbsp;او بدون جهاز التحكم.</p><p>- سهولة التركيب والتعليق - الحفاظ على الجو بارد داخل المبنى بالرغم من ارتفاع درجة الحرارة.</p><p>- يمنع الحشرات والغبار من دخول المكان.</p><p>- يمنع الرطوبة ومياه الأمطار من الدخول.</p><p>- توفير استهلاك الكهرباء في التكييف. - ستارة الهواء يمكن أن تمنع الروائح الكريهة والأبخرة وعوادم السيارات. -</p><p>يعمل بأقل جهد كهربي. - التأثير الإيجابي على بيئة العمل في المنزل.</p><p>- ضمان سنتين.<br />- الحماية الذاتية عند إعادة التشغيل عدة مرات.</p><p>- أماكن الاستخدام (مستشفيات - مطاعم - فنادق - مكاتب - سوبر ماركت - أماكن صناعية - مولات تجارية).</p><p>- الوحدة الخارجية ضد الصدأ.</p><p>- نظام توربو للتبريد السريع.</p><p>- التشغيل التلقائي للجهاز عند عودة التيار</p>', '<p>Fresh Magic Air Curtain 90cm</p>', 6000.00, 5793.00, 5793.00, 20, 22.00, 3.00, '2022-09-11 12:05:08', '2023-12-24 16:41:18'),
(388, '23-01-2316744793871219405250.jpg', 'تكييف شارب 1.5 حصان بارد ستاندر', 'Sharp Air Conditioner 1.5 HP Cool Standard', '<p>تكييف شارب 1.5 حصان بارد ، استاندرد<br />سعة تبريد التكييف : 12000&nbsp;( و ح ب / الساعة )<br />لون التكييف : أبيض<br />تصميم جديد<br />خاصية التبريد السريع<br />خاصية التشغيل الجاف<br />مؤقت تشغيل / إيقاف حتى 12 ساعة<br />مؤقت إيقاف حتى 1 ساعة<br />إماكنيه التحكم فى وضع المروحة ( أتوماتيكياً و على 3 سرعات )<br />خاصية تدفق الهواء الطبيعي<br />التشغيل التلقائي بعد عودة الكهرباء بعد الانقطاع<br />ريموت كنترول مزود بشاشة لعرض البيانات<br />استخدام فريون R410a صديق البيئة<br />موجهات الهواء تعمل بصورة أوتوماتيكية<br />فتحة خروج الهواء كبيرة<br />وحدة خارجية مقاومة للتآكل<br />مزود بمؤشر تنبيه لتنظيف الفلاتر<br />مزود بفلاتر ضد البكتيريا<br />نسبة كفاءة الطاقة : 11 و ح ب / الساعة<br />مستوى كفاءة الطاقة : ( B )<br />طول الوصلات :&nbsp;3 متر<br /><strong>الأبعاد ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 920 &times; 290 &times; 240<br />الوحدة الخارجية : 760 &times; 540 &times; 269<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 9 كجم<br />الوحدة الخارجية : 29 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 11 كجم<br />الوحدة الخارجية : 31 كجم<br /><strong>بلد المنشأ :</strong>&nbsp;مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Air Conditioner 1.5 HP Cool Standard</p>', 18000.00, 16520.00, 16520.00, 0, 46.00, 4.00, '2022-09-11 12:11:50', '2023-11-30 14:57:04'),
(389, '23-01-2316744793401986846599.jpg', 'تكييف شارب 1.5 حصان بارد ديجيتال بلازما', 'Sharp Air Conditioner 1.5 HP Cool Digital With Plasma', '<p>تكييف شارب 1.5 حصان بارد ، بريميم بلاس ، ديچيتال<br />سعة تبريد التكييف : 12000&nbsp;( و ح ب / الساعة )<br />لون التكييف : أبيض<br />مزود بشاشة عرض ديچيتال<br />تصميم جديد<br /><strong>خاصية البلازما كلاستر ( عالية الكثافة ) :</strong><br />تكنولوجيا البلازما كلاستر التي تمتاز بها تكييفات شارب تقوم بالقضاء على البكتيريا<br />والفيروسات المتواجدة بالغرفة عن طريق الأيونات الموجبة والسالبة<br /><strong>خاصية توجيه الهواء في أربع إتجاهات :</strong>&nbsp;يتم توزيع الهواء إلى أعلى وأسفل، يميناً ويساراً عن&nbsp;طريق فتحات التهوية<br /><strong>خاصية My Area :</strong><br />تقوم هذه الخاصية بتقسيم الغرفة إلى 6 أجزاء مع إمكانية توجيه الهواء إلى أحد الأجزاء الستة عند إختيار تشغيل الخاصية<br /><br />خاصية التبريد فائق السرعة<br />خاصية التبريد المعتدل<br />خاصية التنظيف الذاتي بأيونات البلازما كلاستر<br />خاصية التشغيل الجاف<br />مؤقت تشغيل / إيقاف حتى 12 ساعة<br />مؤقت تشغيل / إيقاف حتى 24 ساعة<br />مؤقت إيقاف حتى 5 ساعات<br />خاصية تدفق الهواء الطبيعي<br />التشغيل التلقائي بعد عودة الكهرباء بعد الانقطاع<br />ريموت كنترول مزود بشاشة لعرض البيانات<br />استخدام فريون R410a صديق البيئة<br />موجهات الهواء تعمل بصورة أوتوماتيكية<br />التحكم الفائق في توجيه موجهات الهواء<br />فتحة خروج الهواء كبيرة<br />لوحه الفتح مسطحة عصرية<br />وضع المروحة أتوماتيكياً و على 3 سرعات<br />وحدة خارجية مقاومة للتآكل<br />مزود بمؤشر تنبيه لتنظيف الفلاتر<br />مزود بفلاتر ضد البكتيريا<br />نسبة كفاءة الطاقة : 11 و ح ب / الساعة<br />مستوى كفاءة الطاقة : ( B )<br />طول الوصلات :&nbsp;3 متر<br /><strong>الأبعاد ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 920 &times; 290 &times; 240<br />الوحدة الخارجية : 760 &times; 540 &times; 269<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 9 كجم<br />الوحدة الخارجية : 29 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 11 كجم<br />الوحدة الخارجية : 31 كجم<br /><strong>بلد المنشأ :</strong>&nbsp;مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Air Conditioner 1.5 HP Cool Digital With Plasma</p>', 20000.00, 18075.00, 18075.00, 0, 50.00, 0.00, '2022-09-11 12:13:46', '2023-11-30 14:56:30'),
