: 1122 &times; 327 &times; 259<br />الوحدة الخارجية : 890 &times; 800 &times; 325<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 15 كجم<br />الوحدة الخارجية : 56 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 18 كجم<br />الوحدة الخارجية : 61 كجم<br /><strong>بلد المنشأ :</strong>&nbsp;مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Split Air Conditioner 3 HP Cooling - Hot Digital, Plasma Cluster</p>', 33000.00, 31125.00, 31125.00, 0, 7.00, 0.00, '2022-09-11 12:30:09', '2023-11-30 14:49:28'),
(400, '23-01-2316744789031619358808.jpg', 'تكييف شارب 1.5 حصان بارد فقط ديجيتال بلازما انفرتر', 'Sharp Air Conditioner 1.5 HP Cooling Only Digital Inverter Plasma', '<p>تكييف شارب 1.5 حصان بارد ، انفرتر ، ديچيتال<br />سعة تبريد التكييف : 12624 ( 13820-3650 ) و ح ب / ساعة<br />لون التكييف : سيلفر<br /><strong>تكنولوجيا الانفرتر :-</strong><br />هي تكنولوجيا تساهم في تقليل التكلفة وتوفير الطاقة عن طريق إستخدام أوضاع التشغيل<br />العالية والمنخفضة وذلك بدلاً من التبديل ما بين فصل الكمبروسور وتشغيله.<br /><strong>وضع توفير الطاقة&nbsp;ECO&nbsp;:-</strong><br />يقوم بتشغيل التكييف بأقل استهلاك للطاقة مقارنة بالوضع العادي مما يؤدي<br />الي تقليل تكلفة الكهرباء وذلك عن طريق خطوتين بالريموت كنترول .<br /><strong>مزود بشاشة ديجيتال :</strong>&nbsp;لقياس درجة الحرارة<br /><strong>خاصية البلازما كلاستر :-</strong><br />تكنولوجيا البلازما كلاستر التي تمتاز بها تكييفات شارب تقوم بالقضاء على البكتيريا<br />والفيروسات المتواجدة بالغرفة عن طريق الأيونات الموجبة والسالبة.<br /><strong>خاصية التنظيف الذاتي</strong>&nbsp;بأيونات البلازما كلاستر<br /><strong>خاصية التبريد فائق السرعة :</strong>&nbsp;&nbsp;تقوم بتشغيل التكييف بأقصى قوة لتبريد الغرفة فى&nbsp;أسرع وقت.<br /><strong>خاصية التبريد المعتدل COANDA :</strong>&nbsp;تقوم بتوجيه الهواء المعتدل فى أعلى الغرفة بما لا يؤثر على المتواجدين به.<br /><strong>خاصية توجيه الهواء فى أربع إتجاهات :</strong>&nbsp;يتم توزيع الهواء إلى أعلى وأسفل، يميناً ويساراً عن طريق فتحات التهوية.<br /><strong>مواصفات و خصائص أخرى :-</strong><br />خاصية التشغيل الجاف<br />خاصية التشغيل التلقائي<br />ميقاتي تشغيل / إيقاف حتى 12 ساعة<br />ريموت كنترول مزود بشاشة لعرض البيانات<br />ضبط سرعات المروحة (3 سرعات &amp; سرعة أوتوماتيك )<br />استخدام فريون R410A صديق للبيئة<br />وحدة خارجية مقاومة للتآكل<br />تدفق هواء طبيعي<br />خاصية توجيه الهواء<br />خاصية اعادة التشغيل التلقائي<br />خاصية تشخيص الأعطال<br />نسبة كفاءة الطاقة : 17 و ح ب / الساعة<br />مستوى كفاءة الطاقة : ( ++++A )<br />طول الوصلات : 3 متر<br /><strong>الأبعاد ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 920 &times; 290 &times; 240<br />الوحدة الخارجية : 760 &times; 540 &times; 265<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 9 كجم<br />الوحدة الخارجية : 30 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 12 كجم<br />الوحدة الخارجية : 32 كجم<br /><strong>بلد المنشأ :</strong>&nbsp;مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Split Air Conditioner 1.5 HP Cool Inverter Digital, Plasma Cluster</p>', 25000.00, 22295.00, 22295.00, 0, 10.00, 0.00, '2022-09-11 12:31:15', '2023-11-30 14:48:33'),
