(406, '23-01-2316744786721362086841.jpg', 'تكييف شارب 2.25 حصان بارد ديجيتال بلازما انفرتر', 'Sharp Air Conditioner 2.25 HP Cool Digital With Plasma Inverter', '<p>تكييف شارب 2.25 حصان بارد ، انفرتر ، ديچيتال<br />سعة تبريد التكييف : 17230 ( 18940-6150 ) و ح ب / ساعة<br />لون التكييف : سيلفر<br /><strong>تكنولوجيا الانفرتر :-</strong><br />هي تكنولوجيا تساهم في تقليل التكلفة وتوفير الطاقة عن طريق استخدام اوضاع التشغيل<br />العالية والمنخفضة وذلك بدلاً من التبديل ما بين فصل الكمبروسور وتشغيله<br /><strong>وضع توفير الطاقة&nbsp;ECO&nbsp;:-</strong><br />يقوم بتشغيل التكييف بأقل استهلاك للطاقة مقارنة بالوضع العادي مما يؤدي<br />الي تقليل تكلفة الكهرباء وذلك عن طريق خطوتين بالريموت كنترول<br /><strong>مزود بشاشة ديجيتال</strong>&nbsp;لقياس درجة الحرارة .<br /><strong>خاصية البلازما كلاستر :-</strong><br />تكنولوجيا البلازما كلاستر التي تمتاز بها تكييفات شارب تقوم بالقضاء على البكتيريا<br />والفيروسات المتواجدة بالغرفة عن طريق الأيونات الموجبة والسالبة .<br /><strong>خاصية التنظيف الذاتي</strong>&nbsp;بإستخدام البلازما كلاستر .<br /><strong>خاصية التبريد السريع :&nbsp;</strong>تقوم بتشغيل التكييف بأقصى قوة لتبريد الغرفة فى&nbsp;أسرع وقت.<br /><strong>خاصية التبريد المعتدل :&nbsp;</strong>تقوم بتوجيه الهواء المعتدل فى أعلى الغرفة بما لا&nbsp;يؤثر على المتواجدين بها.<br /><strong>خاصية توجيه الهواء فى أربع إتجاهات :&nbsp;</strong>يتم توزيع الهواء الى أعلى وأسفل، يميناً ويساراً عن&nbsp;طريق فتحات التهوية.<br /><strong>مواصفات و خصائص أخرى :-</strong><br />خاصية التشغيل الجاف<br />خاصية التشغيل التلقائي<br />ميقاتي تشغيل / إيقاف حتى 12 ساعة<br />خاصية التحكم عن بعد<br />ضبط سرعات المروحة ( 3 سرعات &amp; سرعة أوتوماتيك )<br />استخدام فريون R410a صديق للبيئة<br />وحدة خارجية مقاومة للتآكل<br />خاصية توجيه الهواء<br />خاصية تدفق الهواء الطبيعي<br />خاصية اعادة التشغيل التلقائي<br />خاصية تشخيص الأعطال<br />نسبة كفاءة الطاقة : 19.2 و ح ب / الساعة<br />مستوى كفاءة الطاقة : ( +++++A )<br />طول الوصلات :&nbsp;3 متر<br /><strong>الأبعاد ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية :&nbsp;1122 &times; 327 &times; 259<br />الوحدة الخارجية :&nbsp;890 &times; 640 &times; 290<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 15 كجم<br />الوحدة الخارجية : 41 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 18 كجم<br />الوحدة الخارجية : 45 كجم<br /><strong>بلد المنشأ :</strong>&nbsp;مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Split Air Conditioner 2.25 HP Cool Inverter Digital, Plasma Cluster, Silver</p>', 35000.00, 32326.00, 32326.00, 0, 8.00, 0.00, '2022-09-11 12:38:58', '2023-11-30 14:44:22'),
