 &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية :&nbsp;1122 &times; 327 &times; 259<br />الوحدة الخارجية :&nbsp;890 &times; 640 &times; 290<br /><strong>الوزن الصافى :-</strong><br />الوحدة الداخلية : 15 كجم<br />الوحدة الخارجية : 47 كجم<br /><strong>الوزن الإجمالى :-</strong><br />الوحدة الداخلية : 18 كجم<br />الوحدة الخارجية : 51 كجم<br /><strong>بلد المنشأ :</strong>&nbsp;مصر<br /><strong>الضمان</strong>&nbsp;: 5 سنوات ضمان مجانى شامل</p>', '<p>Sharp Split Air Conditioner 2.25 HP Cool - Hot Inverter Digital, Plasma Cluster, Silver</p>', 35000.00, 34140.00, 34140.00, 0, 9.00, 0.00, '2022-09-11 12:39:59', '2023-11-30 14:42:44'),
(408, '23-01-2316744786081382907940.jpg', 'شارب 2.25 حصان انفرتر بارد ساخن بلازما ستايل فيت ابيض', 'Sharp 2.25 HP Inverter Cooling Hot Plasma Style Fit White', '<p>تكييف شارب 2.25 حصان بارد - ساخن ، انفرتر<br />سعة تبريد التكييف : 17400 ( 5730-18085 ) و ح ب / ساعة<br />سعة تدفئة التكييف : 19800 ( 5,450-23,200 ) و ح ب / ساعة<br />لون التكييف : أبيض<br />تصميم عصري حديث<br /><strong>تكنولوجيا الانفرتر :</strong><br />هي تكنولوجيا تساهم في تقليل التكلفة وتوفير الطاقة&nbsp;عن طريق استخدام أوضاع التشغيل<br />العالية&nbsp;والمنخفضة&nbsp;وذلك بدلاً من التبديل ما بين فصل الكمبروسور وتشغيله<br /><strong>وضع ECO :</strong>&nbsp;حيث يقوم بتشغيل التكييف بأقل استهلاك للطاقة مقارنة بالوضع العادي مما يؤدي إلى تقليل تكلفة الكهرباء<br /><strong>خاصية البلازما كلاستر :</strong><br />تكنولوجيا البلازما كلاستر التي تمتاز بها تكييفات شارب تقوم بالقضاء على البكتيريا<br />والفيروسات المتواجدة بالغرفة عن طريق الأيونات الموجبة والسالبة<br /><strong>خاصية التبريد و التسخين فائق السرعة :</strong>&nbsp;تقوم بتشغيل التكييف بأقصى قوة لتبريد أو تدفئة الغرفة في أسرع وقت<br /><strong>خاصية التبريد المعتدل COANDA :</strong><br />في وضع التبريد تقوم بتوجيه الهواء المعتدل إلى أعلى الغرفة بما لا يؤثر على المتواجدين بها<br />في وضع التدفئة تميل ريشة التوجيه العمودي إلى أسفل ليتدفق الهواء الساخن إلى أرضية الغرفة<br /><strong>خاصية توجيه الهواء في أربع إتجاهات :</strong>&nbsp;يتم توزيع الهواء إلى أعلى وأسفل، يميناً ويساراً عن&nbsp;طريق فتحات التهوية<br /><strong>خاصية My Area :</strong><br />تقوم هذه الخاصية بتقسيم الغرفة إلى 6 أجزاء مع إمكانية توجيه الهواء إلى أحد الأجزاء الستة عند إختيار تشغيل الخاصية<br /><strong>خاصية مستشعر الحركة :</strong><br />تقوم بالتحكم في جهاز التكييف باستشعار عدد الأفراد داخل الغرفة وذلك من خلال الضغط على زر Auto ، في حالة عدم وجود<br />أفراد في الغرفة لمدة 60 دقيقة سوف يتم تشغيل التكييف على وضع الحفظ و إذا استشعر وجود أفراد تقوم بإيقاف وضع الحفظ<br /><br />خاصية التنظيف الذاتي بأيونات البلازما كلاستر<br />خاصية التشغيل الجاف<br />خاصية التبريد الهادئ<br />مؤقت تشغيل / إيقاف حتى 12 ساعة<br />مؤقت تشغيل / إيقاف حتى 1 ساعة<br />وظيفة تدفق الهواء الطبيعي<br />التشغيل التلقائي بعد عودة الكهرباء بعد الانقطاع<br />إستخدام فريون&nbsp;R410a&nbsp;صديق للبيئة<br />تشخيص ذاتي للأعطال<br />كمبريسور&nbsp;Hermetically Sealed Rotary<br />كومبريسور&nbsp;Semi Tropical<br />وحدة خارجية مقاومة للتآكل<br />فلتر للأتربة<br />نسبة كفاءة الطاقة : 20 و ح ب / الساعة<br />مستوى كفاءة الطاقة : ( +++++A )<br />الجهد المقنن : 220-240 فولت<br />التردد المقنن : 50 هرتز<br />طول الوصلات : 3 متر<br /><strong>الأبعاد ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 1052 &times; 316 &times; 323<br />الوحدة الخارجية : 890 &times; 640 &times; 290<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 12 كجم<br />الوحدة الخارجية : 47 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 15 كجم<br />الوحدة الخارجية : 51 كجم<br /><strong>بلد المنشأ :-</strong><br />الوحدة الداخلية : تايلاند<br />الوحدة الخارجية : مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Split Air Conditioner 2.25 HP Cool - Heating Inverter, Plasma Cluster, White</p>', 37000.00, 35960.00, 35960.00, 0, 0.00, 0.00, '2022-09-11 12:41:03', '2023-11-30 14:42:07'),
