حتى 12 ساعة<br />مؤقت تشغيل / إيقاف حتى 1 ساعة<br />وظيفة تدفق الهواء الطبيعي<br />التشغيل التلقائي بعد عودة الكهرباء بعد الانقطاع<br />إستخدام فريون&nbsp;R410a&nbsp;صديق للبيئة<br />تشخيص ذاتي للأعطال<br />كمبريسور&nbsp;Hermetically Sealed Rotary<br />كومبريسور&nbsp;Semi Tropical<br />وحدة خارجية مقاومة للتآكل<br />فلتر للأتربة<br />نسبة كفاءة الطاقة : 20 و ح ب / الساعة<br />مستوى كفاءة الطاقة : ( +++++A )<br />الجهد المقنن : 220-240 فولت<br />التردد المقنن : 50 هرتز<br />طول الوصلات : 3 متر<br /><strong>الأبعاد ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 1052 &times; 316 &times; 323<br />الوحدة الخارجية : 890 &times; 640 &times; 290<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 12 كجم<br />الوحدة الخارجية : 47 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 15 كجم<br />الوحدة الخارجية : 51 كجم<br /><strong>بلد المنشأ :-</strong><br />الوحدة الداخلية : تايلاند<br />الوحدة الخارجية : مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Split Air Conditioner 2.25 HP Cool - Heating Inverter, Plasma Cluster, Black</p>', 38000.00, 36350.00, 36350.00, 0, 10.00, 0.00, '2022-09-11 12:42:01', '2023-11-30 14:41:18'),
