(412, '23-01-2316744784401096683440.jpg', 'تكييف شارب 3 حصان بارد ديجيتال بلازما انفرتر', 'Sharp Air Conditioner 3 HP Cool Digital With Plasma Inverter', '<p>تكييف شارب 3 حصان بارد ، انفرتر ، ديچيتال<br />سعة تبريد التكييف : 22350 ( 21500-6720 ) و ح ب / ساعة<br />لون التكييف : سيلفر<br /><strong>تكنولوجيا الانفرتر :-</strong><br />هي تكنولوجيا تساهم في تقليل التكلفة وتوفير الطاقة<br />عن طريق إستخدام أوضاع التشغيل العالية والمنخفضة<br />وذلك بدلاً من التبديل ما بين فصل الكمبروسور وتشغيله<br /><strong>مزود بشاشة ديچيتال :</strong>&nbsp;لقياس درجة الحرارة<br /><strong>خاصية البلازما كلاستر :-</strong><br />تكنولوجيا البلازما كلاستر التي تمتاز بها تكييفات شارب<br />تقوم بالقضاء على البكتيريا والفيروسات المتواجدة<br />بالغرفة عن طريق الأيونات الموجبة والسالبة<br /><strong>خاصية التنظيف الذاتي :</strong>&nbsp;بأيونات البلازما كلاستر<br /><strong>خاصية التبريد فائق السرعة :&nbsp;</strong>تقوم بتشغيل التكييف بأقصى قوة لتبريد الغرفة فى&nbsp;أسرع وقت<br /><strong>&nbsp;خاصية التبريد المعتدل&nbsp;<strong>COANDA&nbsp;</strong>:&nbsp;</strong>تقوم بتوجيه الهواء المعتدل فى أعلى الغرفة بما لا يؤثر على المتواجدين به<br /><strong>خاصية توجيه الهواء فى أربع إتجاهات :</strong>&nbsp;يتم توزيع الهواء إلى أعلى وأسفل، يميناً ويساراً عن طريق فتحات التهوية<br /><strong>مواصفات وخصائص آخرى :-</strong><br />خاصية التشغيل الجاف<br />خاصيه تشخيص الأعطال<br />تايمر 24 ساعة<br />ريموت متعدد الوظائف<br />إستخدام فريون&nbsp;R410A&nbsp;صديق البيئة&nbsp;<br />فتحة خروج الهواء كبيرة<br />كمبريسور Single Rotary<br />كمبريسور تروبيكال يعمل فى المناطق الحارة<br />وحدة خارجية مقاومة للتآكل<br />خاصيه تقسيم الغرفه إلي 6 أجزاء مع إمكانية توجيه الهواء إلى أحد الأجزاء الستة عند إختيار تشغيل الخاصية<br />خاصية التشغيل التلقائي عند انقطاع التيار الكهربائي<br />يعمل على أقل جهد كهربي<br />نسبة كفاءة الطاقة : 19.9 و ح ب / الساعة<br />مستوى كفاءة الطاقة : ( +++++A )<br />الجهد المقنن : 220-240 فولت<br />التردد المقنن : 50 هرتز<br />طول الوصلات : 3 متر<br /><strong>الأبعاد : ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 1122 &times; 327 &times; 259<br />الوحدة الخارجية : 890 &times; 800 &times; 320<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 15 كجم<br />الوحدة الخارجية : 49 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 18 كجم<br />الوحدة الخارجية : 54 كجم<br /><strong>بلد المنشأ :</strong>&nbsp;مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Split Air Conditioner 3 HP Cooling Inverter Digital, Plasma Cluster</p>', 38000.00, 35365.00, 35365.00, 0, 26.00, 4.00, '2022-09-11 12:45:05', '2023-12-02 10:38:35'),
