رتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 1122 &times; 327 &times; 259<br />الوحدة الخارجية : 890 &times; 800 &times; 320<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 15 كجم<br />الوحدة الخارجية : 54.5 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 18 كجم<br />الوحدة الخارجية : 60 كجم<br /><strong>بلد المنشأ :</strong>&nbsp;مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Split Air Conditioner 3 HP Cool - Hot Inverter Digital, Plasma Cluster</p>', 40000.00, 37375.00, 37375.00, 0, 1.00, 0.00, '2022-09-11 12:46:17', '2023-11-30 14:26:23'),
(414, '23-01-2316744782921976352411.jpg', 'شارب 3 حصان بارد ساخن بلازما انفرتر ستايل فيت ابيض', 'Sharp 3 HP Cold Hot Plasma Inverter Style Fit White', '<p>تكييف شارب 3 حصان بارد - ساخن ، انفرتر<br />سعة تبريد التكييف : 22400 ( 5735-21325 ) و ح ب / ساعة<br />سعة تدفئة التكييف : 26100 ( 5,450-28,700 ) و ح ب / ساعة<br />لون التكييف : أبيض<br />تصميم عصري حديث<br /><strong>تكنولوجيا الانفرتر :</strong><br />هي تكنولوجيا تساهم في تقليل التكلفة وتوفير الطاقة&nbsp;عن طريق استخدام أوضاع التشغيل<br />العالية&nbsp;والمنخفضة&nbsp;وذلك بدلاً من التبديل ما بين فصل الكمبروسور وتشغيله<br /><strong>وضع ECO :</strong>&nbsp;حيث يقوم بتشغيل التكييف بأقل استهلاك للطاقة مقارنة بالوضع العادي مما يؤدي إلى تقليل تكلفة الكهرباء<br /><strong>خاصية البلازما كلاستر :</strong><br />تكنولوجيا البلازما كلاستر التي تمتاز بها تكييفات شارب تقوم بالقضاء على البكتيريا<br />والفيروسات المتواجدة بالغرفة عن طريق الأيونات الموجبة والسالبة<br /><strong>خاصية التبريد و التسخين فائق السرعة :</strong>&nbsp;تقوم بتشغيل التكييف بأقصى قوة لتبريد أو تدفئة الغرفة في أسرع وقت<br /><strong>خاصية التبريد المعتدل COANDA :</strong><br />في وضع التبريد تقوم بتوجيه الهواء المعتدل إلى أعلى الغرفة بما لا يؤثر على المتواجدين بها<br />في وضع التدفئة تميل ريشة التوجيه العمودي إلى أسفل ليتدفق الهواء الساخن إلى أرضية الغرفة<br /><strong>خاصية توجيه الهواء في أربع إتجاهات :</strong>&nbsp;يتم توزيع الهواء إلى أعلى وأسفل، يميناً ويساراً عن&nbsp;طريق فتحات التهوية<br /><strong>خاصية My Area :</strong><br />تقوم هذه الخاصية بتقسيم الغرفة إلى 6 أجزاء مع إمكانية توجيه الهواء إلى أحد الأجزاء الستة عند إختيار تشغيل الخاصية<br /><strong>خاصية مستشعر الحركة :</strong><br />تقوم بالتحكم في جهاز التكييف باستشعار عدد الأفراد داخل الغرفة وذلك من خلال الضغط على زر Auto ، في حالة عدم وجود<br />أفراد في الغرفة لمدة 60 دقيقة سوف يتم تشغيل التكييف على وضع الحفظ و إذا استشعر وجود أفراد تقوم بإيقاف وضع الحفظ<br /><br />خاصية التنظيف الذاتي بأيونات البلازما كلاستر<br />خاصية التشغيل الجاف<br />خاصية التبريد الهادئ<br />مؤقت تشغيل / إيقاف حتى 12 ساعة<br />مؤقت تشغيل / إيقاف حتى 1 ساعة<br />وظيفة تدفق الهواء الطبيعي<br />التشغيل التلقائي بعد عودة الكهرباء بعد الانقطاع<br />إستخدام فريون&nbsp;R410a&nbsp;صديق للبيئة<br />تشخيص ذاتي للأعطال<br />كمبريسور&nbsp;Hermetically Sealed Rotary<br />كومبريسور&nbsp;Semi Tropical<br />وحدة خارجية مقاومة للتآكل<br />فلتر للأتربة<br />نسبة كفاءة الطاقة : 20.1 و ح ب / الساعة<br />مستوى كفاءة الطاقة : ( +++++A&nbsp;)<br />الجهد المقنن : 220-240 فولت<br />التردد المقنن : 50 هرتز<br />طول الوصلات : 3 متر<br /><strong>الأبعاد ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 1052 &times; 316 &times; 323<br />الوحدة الخارجية : 890 &times; 800 &times; 325<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 12 كجم<br />الوحدة الخارجية : 54.5 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 15 كجم<br />الوحدة الخارجية : 60 كجم<br /><strong>بلد المنشأ :-</strong><br />الوحدة الداخلية : تايلاند<br />الوحدة الخارجية : مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Split Air Conditioner 3 HP Cool - Heating Inverter, Plasma Cluster, White</p>', 40000.00, 38705.00, 38705.00, 0, 1.00, 0.00, '2022-09-11 12:47:07', '2023-11-30 14:25:21'),
(415, '23-01-2316744782611163129538.jpg', 'شارب 3 حصان بارد ساخن بلازما انفرتر ستايل فيت اسود', 'Sharp 3 HP Cold Hot Plasma Inverter Style Fit Black', '<p>تكييف شارب 3 حصان بارد - ساخن ، انفرتر<br />سعة تبريد التكييف : 22400 ( 5735-21325 ) و ح ب / ساعة<br />سعة تدفئة التكييف : 26100 ( 5,450-28,700 ) و ح ب / ساعة<br />لون التكييف : أسود<br />تصميم عصري حديث<br /><strong>تكنولوجيا الانفرتر :</strong><br />هي تكنولوجيا تساهم في تقليل التكلفة وتوفير الطاقة&nbsp;عن طريق استخدام أوضاع التشغيل<br />العالية&nbsp;والمنخفضة&nbsp;وذلك بدلاً من التبديل ما بين فصل الكمبروسور وتشغيله<br /><strong>وضع ECO :</strong>&nbsp;حيث يقوم بتشغيل التكييف بأقل استهلاك للطاقة مقارنة بالوضع العادي مما يؤدي إلى تقليل تكلفة الكهرباء<br /><strong>خاصية البلازما كلاستر :</strong><br />تكنولوجيا البلازما كلاستر التي تمتاز بها تكييفات شارب تقوم بالقضاء على البكتيريا<br />والفيروسات المتواجدة بالغرفة عن طريق الأيونات الموجبة والسالبة<br /><strong>خاصية التبريد و التسخين فائق السرعة :</strong>&nbsp;تقوم بتشغيل التكييف بأقصى قوة لتبريد أو تدفئة الغرفة في أسرع وقت<br /><strong>خاصية التبريد المعتدل COANDA :</strong><br />في وضع التبريد تقوم بتوجيه الهواء المعتدل إلى أعلى الغرفة بما لا يؤثر على المتواجدين بها<br />في وضع التدفئة تميل ريشة التوجيه العمودي إلى أسفل ليتدفق الهواء الساخن إلى أرضية الغرفة<br /><strong>خاصية توجيه الهواء في أربع إتجاهات :</strong>&nbsp;يتم توزيع الهواء إلى أعلى وأسفل، يميناً ويساراً عن&nbsp;طريق فتحات التهوية<br /><strong>خاصية My Area :</strong><br />تقوم هذه الخاصية بتقسيم الغرفة إلى 6 أجزاء مع إمكانية توجيه الهواء إلى أحد الأجزاء الستة عند إختيار تشغيل الخاصية<br /><strong>خاصية مستشعر الحركة :</strong><br />تقوم بالتحكم في جهاز التكييف باستشعار عدد الأفراد داخل الغرفة وذلك من خلال الضغط على زر Auto ، في حالة عدم وجود<br />أفراد في الغرفة لمدة 60 دقيقة سوف يتم تشغيل التكييف على وضع الحفظ و إذا استشعر وجود أفراد تقوم بإيقاف وضع الحفظ<br /><br />خاصية التنظيف الذاتي بأيونات البلازما كلاستر<br />خاصية التشغيل الجاف<br />خاصية التبريد الهادئ<br />مؤقت تشغيل / إيقاف حتى 12 ساعة<br />مؤقت تشغيل / إيقاف حتى 1 ساعة<br />وظيفة تدفق الهواء الطبيعي<br />التشغيل التلقائي بعد عودة الكهرباء بعد الانقطاع<br />إستخدام فريون&nbsp;R410a&nbsp;صديق للبيئة<br />تشخيص ذاتي للأعطال<br />كمبريسور&nbsp;Hermetically Sealed Rotary<br />كومبريسور&nbsp;Semi Tropical<br />وحدة خارجية مقاومة للتآكل<br />فلتر للأتربة<br />نسبة كفاءة الطاقة : 20.1 و ح ب / الساعة<br />مستوى كفاءة الطاقة : ( +++++A&nbsp;)<br />الجهد المقنن : 220-240 فولت<br />التردد المقنن : 50 هرتز<br />طول الوصلات : 3 متر<br /><strong>الأبعاد ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 1052 &times; 316 &times; 323<br />الوحدة الخارجية : 890 &times; 800 &times; 325<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 12 كجم<br />الوحدة الخارجية : 54.5 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 15 كجم<br />الوحدة الخارجية : 60 كجم<br /><strong>بلد المنشأ :-</strong><br />الوحدة الداخلية : تايلاند<br />الوحدة الخارجية : مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Split Air Conditioner 3 HP Cooling - Heating Inverter, Plasma Cluster, Black</p>', 40000.00, 39150.00, 39150.00, 0, 3.00, 0.00, '2022-09-11 12:47:59', '2023-11-30 14:24:46'),
