(418, '23-01-2316744781561707359365.jpg', 'تكييف شارب 4  حصان بارد ساخن بلازما ديجيتال', 'Sharp Air Conditioner 4 HP Cool & Hot Plasma Digital', '<p>تكييف شارب 4 حصان بارد - ساخن ، حجم كبير ، ديچيتال<br />سعة التبريد : 29500 ( و ح ب / ساعة )<br />سعة التدفئة : 30500 ( و ح ب / ساعة )<br />لون التكييف : أبيض<br />استخدام فلاتر كربونية<br />مزود بخاصية&nbsp;التبريد والتسخين فائق السرعة<br />مزود بشاشة ديچيتال تظهر أثناء تشغيل التكييف فقط ، تعرض درجة حرارة الريموت كنترول<br />خاصية توجيه الهواء في أربع إتجاهات<br />مؤقت تشغيل / إيقاف حتى 12 ساعة<br />مؤقت تشغيل / إيقاف حتى 24 ساعة<br />التشغيل التلقائي بعد عودة الكهرباء بعد الانقطاع<br />استخدام فريون ( R410A ) صديق البيئة<br />تشخيص ذاتي للأعطال<br />كمبريسور Rotary<br />وحدة خارجية مقاومة للتآكل<br />ضغط كهربائي منخفض<br />نسبة كفاءة الطاقة : 11 و ح ب / الساعة<br />الجهد المقنن : 220 فولت<br />التردد المقنن : 50 هرتز<br />طول الوصلات : 3 متر<br /><strong>الأبعاد ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 1186 &times; 258 &times; 340<br />الوحدة الخارجية : 975 &times; 808 &times; 433<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 18 كجم<br />الوحدة الخارجية : 64 كجم<br /><strong>بلد المنشأ :</strong>&nbsp;مصر<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Sharp Split Air Conditioner 4 HP Cooling - Hot Digital, White</p>', 53000.00, 51735.00, 51735.00, 0, 12.00, 0.00, '2022-09-11 12:53:52', '2023-11-30 14:21:34'),
