(431, '05-11-2216676546141630283198.jpg', 'تورنيدو 1.5 حصان بارد ديجيتال بلازما انفرتر', 'Tornado 1.5 HP Cool Digital Plasma Inverter', '<p>تكييف تورنيدو 1.5 حصان بارد ، انفرتر ، ديچيتال<br />سعة تبريد التكييف : 12800 ( و ح ب / ساعة )<br />لون التكييف : أبيض<br />مزود بشاشة عرض ديچيتال ( غير مرئية )<br /><strong>مزود بتكنولوجيا بلازما شيلد :&nbsp;</strong>و هى عبارة عن مولد ايونات موجبة و سالبة تعمل على القضاء على<br />الفيروسات و الجراثيم بداخل الغرفة المحيطة بالجهاز و تعمل أوتوماتيكياً بمجرد تشغيل الجهاز<br /><strong>تكنولوجيا الانفرتر :</strong><br />هى تكنولوجيا تساهم في تقليل التكلفة وتوفير الطاقة&nbsp;عن طريق استخدام أوضاع التشغيل<br />العالية&nbsp;والمنخفضة&nbsp;وذلك بدلاً من التبديل ما بين فصل الكمبروسور وتشغيله</p><p><br />خاصية التبريد السريع<br />خاصية التشغيل الجاف<br />الحماية الذاتية من الحرارة المرتفعة والتجميد<br />خاصية إذابة التجميد من الوحدة الداخلية<br />خاصية توجيه الهواء إلى ( أعلى / أسفل )<br />ضبط سرعات المروحة ( 5 سرعات / سرعة أوتوماتيك )<br />مؤقت تشغيل / إيقاف حتى 12 ساعة<br />مؤقت إيقاف حتى 1 ساعة<br />وظيفة تدفق الهواء الطبيعي<br />خاصية ضبط الوقت<br />التشغيل التلقائي بعد عودة الكهرباء بعد الانقطاع<br />ريموت كنترول مزود بشاشة لعرض البيانات<br />استخدام فريون R410a صديق للبيئة<br />مبادل حراري عالي الكفاءة<br />تشخيص ذاتي للأعطال<br />كمبريسور Single Rotary<br />كمبريسور تروبيكال حيث تم اختباره واعتماده طبقاً للإشتراطات العالمية الخاصة بالمواصفة ( ISO 5151 )<br />وحدة خارجية مقاومة للتآكل<br />فلتر منقي للغبار<br />ضغط كهربائي منخفض<br />نسبة كفاءة الطاقة : 17.7 و ح ب / الساعة<br />مستوى كفاءة الطاقة : ( ++++A )<br />الجهد المقنن : 220 فولت<br />باور سبلاي : 220-240 فولت<br />التردد المقنن : 50 هرتز<br />طول الوصلات : 3 متر<br /><strong>الأبعاد ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 822 &times; 281 &times; 190<br />الوحدة الخارجية : 815 &times; 532 &times; 300<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 8.3 كجم<br />الوحدة الخارجية : 21.8 كجم<br /><strong>الوزن الإجمالي :-</strong