(444, '21-01-231674295207641469409.jpg', 'طقم مفك 6 قطع يد كاوتش ESST0602', '6 Pcs screwdriver set', '<p>طقم مفكات 6 قطع<br />مقبض تصميم جديد<br />المادة ： CR-V<br />شفرة مستديرة<br />1 قطعة SL5.5 * 5 * 75<br />1 قطعة SL5.5 * 5 * 100<br />1 قطعة SL6.5 * 6 * 150<br />1 قطعة PH1 * 5 * 75<br />1 قطعة PH1 * 5 * 100<br />1 قطعة PH2 * 6 * 150<br />معبأة بواسطة شماعات بلاستيكية</p>', '<p>6 pcs screwdriver set<br />New design handle<br />Material：CR-V<br />Round blade<br />1pcs SL5.5*5*75&nbsp;<br />1pcs SL5.5*5*100<br />1pcs SL6.5*6*150<br />1pcs PH1*5*75<br />1pcs PH1*5*100<br />1pcs PH2*6*150<br />Packed by plastic hanger</p>', 200.00, 176.64, 135.88, 19, 51.00, 4.00, '2022-09-11 13:32:53', '2023-12-14 01:54:14'),
(447, '21-01-231674295188557596826.jpg', 'مفك قلاب 6*1 ESDRH0602', '6 In 1 screwdriver set', '<p>مجموعة مفك البراغي 6 في 1<br />2 قطعة بت اتجاهين ：<br />6.35 * 65 ملم ، PH1 + SL5<br />8.00 * 75 ملم ، PH2 + SL6<br />2 قطعة مقبس ： 6 مللي متر ， 8 مللي متر<br />المواد: CR-V<br />مع 1 قطعة مقبض قابل للتبديل<br />معبأة بواسطة مربع لون العرض</p>', '<p>6 IN 1 Screwdriver set<br />2 pcs two-way bit：<br />6.35*65mm,PH1+SL5<br />8.00*75mm,PH2+SL6<br />2pcs socket：6mm，8mm<br />Material:CR-V<br />With 1pcs interchangeable handle<br />Packed by Display color box</p>', 150.00, 107.94, 83.03, 50, 19.00, 0.00, '2022-09-11 13:35:16', '2023-11-22 14:00:38'),
