(583, '21-01-231674291629928099072.jpg', 'سكينه معجون 2.5 بوصه يد بلاستيك EPTL06001', 'Putty trowel', '<p>الحجم: 60 مم (2.5 بوصة) الفولاذ المقاوم للصدأ المعالجة الحرارية مصقول بشكل جيد مقبض بلاستيكي مزدوج اللون معبأة حسب التسمية</p><p>كود/EPTL06001</p>', '<p>Size:60mm(2.5&#39;&#39;)<br />stainless steel<br />Heat treatment<br />Fine polished&nbsp;<br />Double color plastic handle<br />Packed by label</p>', 85.00, 51.19, 39.38, 395, 8.00, 0.00, '2022-09-11 17:16:08', '2023-11-25 11:23:00'),
(584, '28-01-231674907058390044476.jpg', 'سكينة معجون 3 بوصة يد كاوتش EPTL08001', 'Putty trowel', '<p>الحجم: 80 مم (3 بوصة) الفولاذ المقاوم للصدأ المعالجة الحرارية مصقول بشكل جيد مقبض بلاستيكي مزدوج اللون معبأة حسب التسمية</p>', '<p>Size:80mm(3&#39;&#39;)<br />stainless steel<br />Heat treatment<br />Fine polished&nbsp;<br />Double color plastic handle<br />Packed by label</p>', 85.00, 57.19, 43.99, 488, 14.00, 0.00, '2022-09-11 17:16:57', '2023-11-25 11:24:25'),
