(593, '28-01-2316749060632106849783.jpg', 'خيط علام بودرة 30 متر ECLR3001', 'Chalk line reel', '<p>Chalk line reel<br />Length: 30m<br />With 1 bottle chalk<br />With 1 pcs spirit bubble<br />Packed by double &nbsp;blister</p>', '<p>Chalk line reel<br />Length: 30m<br />With 1 bottle chalk<br />With 1 pcs spirit bubble<br />Packed by double &nbsp;blister</p>', 160.00, 121.11, 93.16, 244, 12.00, 0.00, '2022-09-11 17:39:50', '2023-11-25 11:45:03'),
