(601, '21-01-231674291417824337110.jpg', 'روله لاكيه 4 بوصه بالدراع ECBH061001', 'Mini cylinder brush(Inner wall)', '<p>المادة: ألياف دقيقة الحجم: 100 مم / 4 &quot; ارتفاع الألياف: 12 مم مناسب للجدار الداخلي 6 ملم عرقوب مركزي مع 1 قطعة غطاء الأسطوانة تطابق مع مقبض فريد معبأة في كيس من البلاستيك</p><p>كود/ECBH061001</p>', '<p>Material:Micro fibre<br />Size:100mm/4&quot;<br />Fibre height:12mm<br />Suitable for inner wall<br />6mm central shank<br />With 1pcs roller cover<br />Match with Unique handle<br />Packed by plastic bag</p>', 70.00, 51.08, 39.29, 123, 41.00, 0.00, '2022-09-11 17:59:31', '2023-11-25 12:28:33'),
(603, '21-01-231674291400427297862.jpg', 'رولة 9 بوصة بالدراع  ECBH042301', 'Cylinder brush(Inner wall)', '<p>المادة: ألياف دقيقة<br />الحجم: 230 ملم / 9 بوصة<br />ارتفاع الألياف: 12 مم<br />مناسب للجدار الداخلي<br />6 ملم عرقوب مركزي<br />مع 1 قطعة غطاء الأسطوانة<br />مع 4 قطعة مساعد عرقوب<br />معبأة في كيس من البلاستيك</p><p>كود/ECBH042301</p>', '<p>Material:Micro fibre<br />Size:230mm/9&quot;<br />Fibre height:12mm<br />Suitable for inner wall<br />6mm central shank<br />With 1pcs roller cover<br />With 4pcs assistant shank<br />Packed by plastic bag</p>', 120.00, 85.66, 65.89, 113, 19.00, 0.00, '2022-09-11 18:01:55', '2023-11-25 13:13:58'),
(604, '28-01-2316749056991428361944.jpg', 'غيار رولة 9 بوصة ECBH062302', 'Roller cover', '<p>&nbsp;</p><p>مناسب لـ ECBH042301 ، ECBHT42302 ، ECBH16093801 المادة: ألياف دقيقة الحجم: 230 ملم / 9 بوصة ارتفاع الألياف: 12 مم يستخدم للجدار الداخلي معبأة في كيس من البلاستيك</p>', '<p>Suitable for ECBH042301,ECBHT42302,ECBH16093801<br />Material:Micro fibre<br />Size:230mm/9&quot;<br />Fibre height:12mm<br />Used for inner wall<br />Packed by plastic bag</p>', 45.00, 33.42, 25.71, 991, 8.00, 0.00, '2022-09-11 18:02:36', '2023-11-25 13:16:36'),
