(614, '28-01-2316749056831023415754.jpg', 'متر 3متر*16مللي كاوتش EMTP23101', 'Steel measuring tape', '<p>الطول والعرض: 3 م &times; 16 مم وظيفة القفل الذاتي متري فقط زر مزدوج مع كل غطاء مطاطي معبأة حسب التسمية</p>', '<p>Length &amp; width:3mx16mm<br />Self lock function<br />Only metric<br />Double button<br />With all rubber cover<br />Packed by label</p>', 88.00, 55.46, 42.66, 91, 10.00, 0.00, '2022-09-11 18:11:35', '2023-11-25 13:23:24'),
(615, '28-01-2316749056661818192481.jpg', 'متر  5متر*19مللي كاوتش EMTP25101', 'Steel measuring tape', '<p>الطول والعرض: 5 م &times; 19 مم وظيفة القفل الذاتي متري فقط زر مزدوج مع كل غطاء مطاطي معبأة حسب التسمية</p>', '<p>Length &amp; width:5mx19mm<br />Self lock function<br />Only metric<br />Double button<br />With all rubber cover<br />Packed by label</p>', 100.00, 81.07, 62.36, 177, 27.00, 0.00, '2022-09-11 18:12:14', '2023-11-25 13:24:36'),
(618, '28-01-231674905566433407035.jpg', 'متر فايبر 30 متر * 12.5 مللي خدمة شاقة EMTP83001', 'Fibreglass measuring tape', '<p>نسبة التروس 3: 1 للإرجاع السريع الطول والعرض: 30 م &times; 12.5 ملم بالمتر والبوصة معدات تراجع المواد النقية مع كل غطاء مطاطي مقبض مدمج جيد للاستخدام والتخزين المريح معبأة بواسطة مربع اللون</p>', '<p>3:1 Gear ratio for fast rewind<br />Length &amp; width:30mx12.5mm<br />With metric and inch<br />Pure material retracting gear<br />With all rubber cover<br />Integrated handle good for useing and convenient storing<br />Packed by color box</p>', 300.00, 261.00, 200.77, 146, 4.00, 0.00, '2022-09-11 18:14:39', '2023-11-25 13:28:06'),
(619, '28-01-231674905490784942051.jpg', 'متر مساحة فايبر 50 متر * 5.12 مللي جودة عالية EMTP85001', 'Fibreglass measuring tape', '<p>نسبة التروس 3: 1 للإرجاع السريع الطول والعرض: 50 م &times; 12.5 ملم بالمتر والبوصة معدات تراجع المواد النقية مع كل غطاء مطاطي مقبض مدمج جيد للاستخدام والتخزين المريح مقبض مريح معبأة بواسطة مربع اللون</p>', '<p>3:1 Gear ratio for fast rewind<br />Length &amp; width:50mx12.5mm<br />With metric and inch<br />Pure material retracting gear<br />With all rubber cover<br />Integrated handle good for useing and convenient storing<br />Ergonomic handle&nbsp;<br />Packed by color box</p>', 500.00, 424.02, 326.17, 46, 4.00, 0.00, '2022-09-11 18:15:42', '2023-11-25 13:29:44'),
(626, '21-01-2316742911031453011271.jpg', 'ميزان مياه مغناطيس 40 سم معدني ESLL34001', 'Spirit level with powerful magnets', '<p>الطول ： 60 سم ضعف الجانب مطحون 0.5 مم / م قوارير دقيقة السماكة: 1.5 مم 3 قطع مغناطيس قوي تصميم أسطح مستوية مزدوجة معبأة بأكمام اللون</p><p>كود/ESLL34001</p><p>&nbsp;</p>', '<p>Length：60cm<br />Double side milled<br />0.5mm/m accurate vials<br />Thickness:1.5mm<br />3 Pcs powerful magnets<br />Double flat surfaces design<br />Packed by color sleeve</p>', 400.00, 308.75, 237.50, 6, 6.00, 0.00, '2022-09-11 18:27:27', '2023-11-25 13:33:59');
