(628, '21-01-2316742910121210285673.jpg', 'ميزان مياه مغناطيس 100 سم معدني ESLL310001', 'Spirit level with powerful magnets', '<p>الطول ： 100 سم<br />ضعف الجانب مطحون<br />0.5 مم / م قوارير دقيقة<br />السماكة: 1.5 مم<br />4 قطع مغناطيس قوي<br />تصميم أسطح مستوية مزدوجة<br />معبأة بأكمام اللون</p><p>كود/ESLL310001</p>', '<p>Length：100cm<br />Double side milled<br />0.5mm/m accurate vials<br />Thickness:1.5mm<br />4 Pcs powerful magnets<br />Double flat surfaces design<br />Packed by color sleeve</p>', 750.00, 621.62, 478.17, 3, 0.00, 0.00, '2022-09-11 18:28:54', '2023-11-25 13:38:52'),
(629, '21-01-231674290987929033143.jpg', 'ميزان مياه 60 سم صلب خدمه شاقه ESLL56001', 'Heavy-duty mason\'s level', '<p>الطول ： 60 سم الوزن الصافي: 790 جرام الدقة: 0.5 مم / م السطح السفلي المطحون بدقة والسطح الأمامي هيكل مدبب من الألومنيوم المصبوب شديد التحمل وسادات مطاطية ماصة للصدمات وأغطية طرفية لتحمل ضربات المجرفة وحماية سلامة المستوى فقاعات روح أفقية وعمودية معبأة بأكمام اللون</p><p>كود/ESLL56001</p>', '<p>Length：60cm<br />Net weight:790g&nbsp;<br />Accuracy:0.5mm/m<br />Finely milled bottom surface and front surface<br />Heavy-duty cast aluminum tapered body<br />Shock-absorbing rubber strike pads &amp; end caps<br />To withstand trowel blows and protect the level&rsquo;s integrity<br />Horizontal &amp; vertical spirit bubbles<br />Packed by color sleeve</p>', 550.00, 486.60, 374.31, 14, 5.00, 0.00, '2022-09-11 18:29:36', '2023-11-25 13:41:32'),
(631, '21-01-2316742909571523649161.jpg', 'متر ليزر  قياس 60 متر ELDD0601', 'Laser distance detector', '<p>نطاق القياس: 0.05-60 م<br />دقة القياس: &plusmn; 2.0 مم<br />نوع الليزر: 635 نانومتر ، &lt;1 ميجا واط ، الفئة 2<br />درجة حرارة التشغيل: -10 درجة مئوية ~ + 50 درجة مئوية<br />الوظيفة: المسافة والمساحة والحجم والارتفاع<br />مع وظيفة إيقاف التشغيل<br />مع حقيبة قماش 1 قطعة<br />بطارية قلوية متضمنة<br />معبأة بواسطة مربع اللون</p><p>كود/ELDD0601</p>', '<p>Measuring Range:0.05-60m<br />Measuring Accuracy:&plusmn;2.0mm<br />Laser Type:635nm, &lt;1mW, Class 2<br />Operating temp:-10&deg;C ~ +50&deg;C<br />Function:Distance,area,volume,height<br />With power off function<br />With 1pcs canvas bag<br />Alkaline battery included<br />Packed by color box</p>', 2150.00, 1990.03, 1530.79, 9, 4.00, 0.00, '2022-09-11 18:31:06', '2023-11-25 13:42:57'),
(633, '21-01-2316742909351804875187.jpg', 'ميزان ليزر 2 خط ضوء احمر 15 متر ESLE21501', 'Laser scale 2 cheek red light 15 meters', '<p>نطاق العمل: 0 ~ 15 م دقة التسوية: &plusmn; 1.5 مم عند 5 م دقة الخط &plusmn; 1.5 مم عند 5 م وقت التسوية &lt;4s زاوية التسوية الذاتية &le;4 &deg; نوع الليزر 650nm فئة الليزر Ⅱ ， &lt;1 ميجا واط مع المغناطيس مع فتحة معلقة بدون حوامل ثلاثية القوائم ، تطابق مع حوامل ETPD12001 مع وظيفة الخط الأفقي والعمودي مع وظيفة القفل المتقاطع مع وظيفة اكتساب الليزر درجة حرارة التشغيل 0 ~ + 40 درجة مئوية درجة حرارة التشغيل -20 ~ + 70 درجة مئوية بطاريات AA (1.5 فولت) * 3 بطارية قلوية متضمنة الوزن بدون بطاريات 305 جرام الأبعاد (ارتفاع &times; عمق &times; عرض) 98 &times; 58 &times; 96 مم معبأة بواسطة مربع اللون</p><p>كود/ESLE21501</p>', '<p>Working Range: 0~15 m<br />Levelling accuracy:&plusmn;1.5mm at 5 m<br />Line accuracy &plusmn;1.5mm at 5 m<br />Levelling time&lt;4s<br />Self-levelling angle &le;4&deg;<br />Laser Type 650nm<br />Laser Class Ⅱ，&lt;1mW<br />With magnet<br />With hanging hole<br />Without tripods, match with ETPD12001 tripods<br />With Horizontal and Vertical &nbsp;Line Function<br />With Cross Lock Function<br />With Laser Gain Function<br />Operating temperature 0~+40℃<br />Operating temperature -20~+70℃<br />Batteries AA(1.5V)*3<br />Alkaline battery included<br />Weight without batteries 305 g<br />Dimensions (H &times; D &times; W) 98&times;58&times;96mm<br />Packed by color box</p>', 2200.00, 1933.22, 1487.09, 0, 2.00, 0.00, '2022-09-11 18:32:22', '2023-11-25 13:44:29'),
(641, '21-01-231674290916354792001.jpg', 'مفك تست ETPL19001', 'Test pencil', '<p>اختبار الجهد: AC 100-500V الحجم المشقوق: 4x190mm معبأة بواسطة شماعات بلاستيكية</p><p>كود/ETPL19001</p>', '<p>Test Voltage:AC 100-500V<br />Slotted size: 4x190mm<br />Packed by plastic hanger</p>', 40.00, 28.15, 21.65, 493, 27.00, 0.00, '2022-09-11 18:40:33', '2023-11-25 14:12:58'),
(643, '21-01-2316742909031360429182.jpg', 'كاشف تيار ETPL210001', 'Non-contact AC voltage detector', '<p>جهد التيار المتردد: 12 فولت ~ 1000 فولت (حساسية عالية)<br />48 ~ 1000 فولت (حساسية منخفضة)<br />التردد: 50/60 هرتز<br />وضع التنبيه: إنذار الصوت والضوء<br />ضوء الفلاش: أبيض LED<br />مؤشر انخفاض البطارية<br />إيقاف التشغيل التلقائي<br />غطاء بطارية قابل للتبديل<br />تمييز تلقائي لخط Live وخط Netural<br />البطارية متضمنة<br />معبأة بواسطة نفطة مزدوجة</p><p>كود/ETPL210001</p>', '<p>AC Voltage: 12V~1000V(High sensitivity)<br />48~1000V(Low sensitivity)<br />Frequency:50/60Hz<br />Alarm mode: Sound and light alarm<br />Flash light : White LED<br />Low battery indication<br />Auto power off<br />Switchable battery cover<br />Auto distinguish the Live line and Netural line<br />Battery included<br />Packed by double blister</p>', 400.00, 321.10, 247.00, 149, 2.00, 0.00, '2022-09-11 18:42:40', '2023-11-25 14:14:23'),
(644, '19-01-2316741224261460691758.jpg', 'مقص تسليح ميني 8 بوصه EBCR0801', 'Intelligent voltage-detecting stripper', '<p>متجرد ذكي للكشف عن الجهد كشف الجهد غير المتصل التجريد والقطع والعص نطاق أسلاك التجريد: 10AWG ~ 24AWG (0.2 ~ 6mm&sup2;) وظيفة القطع: أسلاك النحاس والألمنيوم وظيفة العقص: تجعيد المحطات المعزولة 0.5-6 مم&sup2; (22-10AWG) ؛ تجعيد الأطراف غير المعزولة: 0.5-6 مم&sup2; （24-10AWG） ؛ قم بتجعيد أطراف الإشعال: 7-8 مم&sup2; مقبض متين ومريح معبأة ببطاقة منزلقة</p><p>كود/EBCR0801</p>', '<p>Intelligent Voltage-Detecting Stripper<br />Non-contact voltage detection，Stripping,cutting and crimping<br />Stripping wires range:10AWG~24AWG(0.2~6mm&sup2;)<br />Cutting function:Copper and aluminum wires<br />Crimping function:<br />Crimp the insulated terminals 0.5-6mm&sup2; (22-10AWG);<br />Crimp the non-insulated terminals: 0.5-6mm&sup2;（24-10AWG）;<br />Crimp the ignition terminals: 7-8mm&sup2;<br />Durable and comfortable handle<br />Packed by sliding card</p>', 200.00, 140.79, 108.30, 60, 7.00, 0.00, '2022-09-11 18:43:32', '2023-11-22 12:21:02'),
