(651, '19-01-2316741223641910820041.jpg', 'جوانتي رابر XL ENGV0101XL', 'Nitrile gloves', '<p>المقاس ： XL استخدم لعمال مناولة البضائع الثقيلة ، وحاملة الأشياء الحادة الطفيفة ، إلخ. كفوف مطاطية غلاف محبوك من القطن / البوليستر غير الملحوم. عمق محكم لراحة اليد لمزيد من الثبات والمتانة. معبأة بواسطة كيس بولي</p><p>كود/ENGV0101XL</p>', '<p>Size：XL<br />Use for oil environment &nbsp;(Less oil)worker etc.<br />Nitrile coated palm, smooth and rough-texture palm finish.<br />Packed by poly bag</p>', 55.00, 33.28, 25.60, 283, 34.00, 0.00, '2022-09-11 18:51:19', '2023-11-25 14:34:24'),
(652, '19-01-2316741223132095605476.jpg', 'جوانتي  لاتكس ضد القطع   EXGV0301XL', 'Latex gloves', '<p>المقاس ： XL<br />استخدم لعمال مناولة البضائع الثقيلة ، وحاملة الأشياء الحادة الطفيفة ، إلخ. كفوف مطاطية غلاف محبوك من القطن / البوليستر غير الملحوم. عمق محكم لراحة اليد لمزيد من الثبات والمتانة. معبأة بواسطة كيس بولي</p><p>كود/EXGV0301XL</p>', '<p>Size：XL<br />Use for heavy cargo handling worker, slight sharp objects carrier etc.<br />Latex gloves<br />Cotton/polyester seamless knitted shell.&nbsp;<br />Textured palm dip for extra grip and durability.<br />Packed by poly bag</p>', 200.00, 158.02, 121.55, 219, 37.00, 0.00, '2022-09-11 18:52:04', '2023-11-25 14:37:05'),
(654, '19-01-2316741223161638690290.jpg', 'جوانتي رابر  احمال XL EXGV0201XL', 'Cut-resistant gloves', '<p>الحجم: XL<br />استخدم لعمال قطع الأخشاب والزجاج ، وحاملات الأشياء الحادة الثقيلة وما إلى ذلك من الضغط ، عمر أطول من المعتاد النخيل المطلي باللاتكس غلاف HPPE ، مقاومة القطع والتآكل معبأة بواسطة كيس بولي</p><p>كود/EXGV0201XL</p>', '<p>Size:XL<br />Use for timber and glass cutting worker, heavy sharp objects carriers etc<br />From pressing,longer life time than normal<br />Latex coated palm<br />HPPE shell,cut-resistance and abrasion<br />Packed by poly bag</p>', 80.00, 66.56, 51.20, 483, 19.00, 0.00, '2022-09-11 18:54:00', '2023-11-25 14:35:54'),
(655, '19-01-231674122276518030138.jpg', 'جوانتي ميكانيكي مبطن EMGV0101XL', 'Mechanic gloves', '<p>الحجم: XL تعمل راحة اليد المصنوعة من الألياف الدقيقة مع جلد PVC المقوى على راحة اليد على تعزيز مقاومة التآكل الشديدة يمنع المطاط الموجود على الظهر اليد من المخاطر في الظلام حزمة بواسطة شماعات الورق</p><p>كود/EMGV0101XL</p>', '<p>Size:XL<br />Microfibre material palm with PVC leather reinforced on palm enhance extreme abrasion resistance<br />Rubber on back prevent hand from hazards in dark<br />Pack by paper hanger</p>', 500.00, 410.83, 316.02, 193, 9.00, 0.00, '2022-09-11 18:55:05', '2023-11-25 14:38:27'),
(658, '19-01-231674122253976510435.jpg', 'حزام سيفتي ESHS15001', 'Safety harness', '<p>1 نقطة التعلق<br />4 نقطة الضبط<br />المواد: بوليستر عالي القوة<br />عرض حزام: 50mm<br />حجم حبل الأمان: ￠ 13mm * 1.5m<br />مادة حبل الأمان: بوليستر<br />معبأة بواسطة مربع اللون</p><p>كود/ESHS15001</p>', '<p>1 Attachment point<br />4 Adjustment point<br />Material:high strength polyester<br />Webbing width:50mm<br />Safety rope size : ￠13mm*1.5m&nbsp;<br />Safety rope material:polyester<br />Packed by color box</p>', 900.00, 773.42, 594.94, 40, 2.00, 0.00, '2022-09-11 18:58:28', '2023-11-25 14:42:46'),
(660, '19-01-2316741222361591360563.jpg', 'وش لحام اتوماتيك ارجون EWHT0102', 'Auto darkening welding helmet', '<p>منطقة الرؤية: 90 &times; 35 مم<br />حجم الخرطوشة: 110 &times; 90 &times; 10 مم<br />مستشعر القوس: 2<br />حالة الضوء: DIN 4<br />الحالة المظلمة: الظل الثابت 11<br />التحكم في الظل: غير قابل للتعديل<br />تشغيل / إيقاف: تلقائي بالكامل<br />التحكم في الحساسية: تلقائي غير قابل للتعديل<br />الحماية من الأشعة فوق البنفسجية / الأشعة تحت الحمراء: DIN 16<br />مزود الطاقة: الخلايا الشمسية. بطارية قابلة لإعادة الشحن. لا يلزم تغيير البطارية<br />وقت التبديل: 1/5000 ثانية من الضوء إلى الظلام<br />الظلام للضوء: 0.15-0.45 ثانية تلقائي<br />التيار المنخفض TIG: &ge;20amps (DC) ، &ge;20amps (AC)<br />وقت التشغيل: -5 درجة مئوية ~ + 55 درجة مئوية<br />تخزين tep: -20 درجة مئوية ~ + 70 درجة مئوية<br />معبأة بواسطة مربع اللون</p><p>كود/EWHT0102</p>', '<p>Viewing area:90&times;35mm<br />Cartridge size:110&times;90&times;10mm<br />Arc sensor:2<br />Light state:DIN 4<br />Dark state:fixed shade 11<br />Shade control:unadjustable<br />Power ON/OFF:fully automatic<br />Sensitivity control:unadjustable,auto<br />UV/IR protection:DIN 16<br />Power supply:solar cells. re-chargeable battery .no battery change required<br />Switching time:1/5000s,from ;light to dark<br />Dark to light:0.15-0.45s auto<br />Low amperage TIG:&ge;20amps(DC), &ge;20amps(AC)<br />Operating tep:-5℃~+55℃<br />Storing tep:-20℃~+70℃<br />Packed by color box</p>', 900.00, 753.57, 579.67, 15, 16.00, 0.00, '2022-09-11 19:00:06', '2023-11-25 14:45:56'),
(661, '19-01-2316741222151225350709.jpg', 'نظاره حمايه ضد الرايش شفاف اطار ملون ESGG0101', 'Safety goggles', '<p>طول المعبد: 4 أوضاع مختلفة<br />تصميم مدمج من النوع المطوق يوفر حماية للجناح<br />معبأة بواسطة نفطة مزدوجة</p><p>كود/ESGG0101</p>', '<p>The length of temple:4 different positions<br />Integrated encircling type design gives flank protection<br />Packed by double blister</p>', 70.00, 52.42, 40.32, 50, 51.00, 0.00, '2022-09-11 19:00:50', '2023-12-21 08:45:23'),
(667, '19-01-231674122183160625196.jpg', 'مقص نباتات 8.5 بوصه خدمه شاقه EPSA038501', 'Pruning shear', '<p>الحجم: 8.5 بوصة (220 ملم)<br />إطار معدني كامل ، أكثر متانة<br />مقص تقليم حديقة عالي الجودة<br />55 # شفرة من الصلب الكربوني<br />طلاء Telfon المعالجة الحرارية<br />مقبض PP غطاء قبضة TPR<br />معبأة ببطاقة نفطة</p><p>كود/EPSA038501</p>', '<p>Size:8.5&quot;(220mm)<br />Entire metal frame,more durable<br />High-Quality Garden Pruning Shear<br />55# carbon steel blade<br />Heat treatment Telfon coating<br />PP handle coverd TPR grip<br />Packed by blister card</p>', 220.00, 177.02, 136.17, 60, 5.00, 0.00, '2022-09-11 19:05:02', '2023-11-26 11:46:01'),
(668, '19-01-231674122165130125842.jpg', 'مقص اشجار 22 بوصه خدمه شاقه EPSR630102', 'Hedge shear', '<p>الطول: 22 بوصة (557 ملم)<br />المواد: 55 # الكربون الصلب<br />شفرة المعالجة الحرارية<br />نصل مطلي تفلون<br />معبأة بواسطة شماعات الورق</p><p>كود/EPSR630102</p>', '<p>Length:22&quot;(557mm)<br />Material:55# carbon steel<br />Heat treatment blade&nbsp;<br />Blade painted teflon<br />Packed by paper hanger</p>', 450.00, 390.27, 300.21, 49, 5.00, 0.00, '2022-09-11 19:05:51', '2023-11-26 11:47:57'),
(669, '19-01-2316741221481306420023.jpg', 'مقص عقله 30 بوصه EPSR740103', 'Lopper', '<p>الطول: 30 بوصة (760 ملم)<br />أقصى قطر للقطع: 25 مللي متر<br />المواد: 55 # الكربون الصلب<br />وظيفة الضغط على النصل<br />شفرة المعالجة الحرارية<br />نصل مطلي تفلون<br />معبأة بواسطة شماعات الورق</p><p>كود/EPSR740103</p>', '<p>Length:30&quot;(760mm)<br />Max cutting diameter:25mm<br />Material:55# carbon steel<br />Stress function on blade<br />Heat treatment blade&nbsp;<br />Blade painted teflon<br />Packed by paper hanger</p>', 550.00, 468.48, 360.37, 79, 1.00, 0.00, '2022-09-11 19:06:32', '2023-11-26 11:50:03'),
(673, '21-01-2316742908611759318548.jpeg', 'منشار اغصان شجر 13 بوصة 330 مللي EHASP3301', 'Wood chipper 13 inch 330 mm', '<p>الحجم: 13 بوصة / 330 ملم مادة ： 65Mn 7TPI أسنان ثلاثية (أسنان أرضية دقيقة 3 حواف) مع وظيفة شريط التمديد قطع سريع معبأة بأكمام اللون</p>', '<p>Size:13&quot;/330mm<br />Material：65Mn<br />7TPI<br />Triple teeth(Precision ground teeth 3 edges)<br />With Extension bar function<br />Fast cut&nbsp;<br />Packed by color sleeve</p>', 250.00, 181.10, 139.31, 17, 9.00, 0.00, '2022-09-11 19:11:22', '2023-11-26 11:52:17'),
