(681, '19-01-2316741218911109780357.jpg', 'انبوبه سيلكون 30 مللي ( ابيض) EASS3001', 'Acetic silicone sealant(White)', '<p>أبيض<br />سيليكون الخليك مانع التسرب<br />السعة: 300 مل / قطعة<br />تكوين الجلد: 5-10 دقائق (23 ℃ و 50٪ رطوبة نسبية)<br />وقت المعالجة: 20 ساعة (23 ℃ و 50٪ رطوبة نسبية)<br />معبأة بواسطة زجاجة بلاستيكية</p><p>كود/EASS3001</p>', '<p>White<br />Acetic Silicone Sealant<br />Capacity:300ml/pcs<br />Skin formation:5-10min(23℃ and 50%R.H)<br />Curing time:20H(23℃ and 50%R.H)<br />Packed by plastic bottle</p>', 150.00, 103.91, 79.93, 486, 13.00, 0.00, '2022-09-11 19:18:07', '2023-12-05 13:48:34'),
