(684, '30-11-221669828220542265848.jpg', 'تكييف تورنيدو 3 حصان بارد ساخن ديجيتال بلازما انفرتر', 'Tornado Air Conditioner 3 HP Cool & Hot Digital With Plasma Inverter', '<p>تكييف تورنيدو 3 حصان بارد - ساخن ، انفرتر ، ديچيتال<br />سعة تبريد التكييف : 23500 ( و ح ب / ساعة )<br />سعة تدفئة التكييف : 23500 ( و ح ب / ساعة )<br />لون التكييف : أبيض<br />مزود بشاشة عرض ديجيتال ( غير مرئية )<br /><strong>مزود بتكنولوجيا بلازما شيلد :</strong>&nbsp;و هى عبارة عن مولد ايونات موجبة و سالبة تعمل على القضاء على<br />الفيروسات و الجراثيم بداخل الغرفة المحيطة بالجهاز و تعمل أوتوماتيكياً بمجرد تشغيل الجهاز<br /><strong>تكنولوجيا الانفرتر :</strong><br />هى تكنولوجيا تساهم في تقليل التكلفة وتوفير الطاقة&nbsp;عن طريق استخدام أوضاع التشغيل<br />العالية والمنخفضة وذلك بدلاً من التبديل ما بين فصل الكمبروسور وتشغيله<br /><br />خاصية التبريد فائق السرعة<br />خاصية التبريد السريع<br />خاصية التشغيل الجاف<br />الحماية الذاتية من الحرارة المرتفعة والتجميد<br />خاصية إذابة التجميد من الوحدة الداخلية<br />خاصية توجيه الهواء إلى ( أعلى / أسفل )<br />ضبط سرعات المروحة ( 5 سرعات / سرعة أوتوماتيك )<br />مؤقت تشغيل / إيقاف حتى 12 ساعة<br />مؤقت إيقاف حتى 1 ساعة<br />وظيفة تدفق الهواء الطبيعي<br />خاصية ضبط الوقت<br />التشغيل التلقائي بعد عودة الكهرباء بعد الانقطاع<br />ريموت كنترول مزود بشاشة لعرض البيانات<br />استخدام فريون R410a صديق للبيئة<br />تشخيص ذاتي للأعطال<br />كمبريسور Twin Rotary<br />كمبريسور تروبيكال حيث تم اختباره واعتماده طبقاً للإشتراطات العالمية الخاصة بالمواصفة ( ISO 5151 )<br />وحدة خارجية مقاومة للتآكل<br />فلتر منقي للغبار<br />ضغط كهربائي منخفض<br />نسبة كفاءة الطاقة : 17.2 و ح ب / الساعة<br />مستوى كفاءة الطاقة : ( ++++A )<br />الجهد المقنن : 220 فولت<br />باور سبلاي : 220-240 فولت<br />التردد المقنن : 50 هرتز<br />طول الوصلات : 3 متر<br /><strong>الأبعاد ( العرض &times; الارتفاع &times; العمق ) مم :-</strong><br />الوحدة الداخلية : 1053 &times; 323 &times; 226<br />الوحدة الخارجية : 1009 &times; 638 &times; 364<br /><strong>الوزن الصافي :-</strong><br />الوحدة الداخلية : 11.7 كجم<br />الوحدة الخارجية : 37.1 كجم<br /><strong>الوزن الإجمالي :-</strong><br />الوحدة الداخلية : 16.7 كجم<br />الوحدة الخارجية : 42 كجم<br /><strong>بلد المنشأ :</strong>&nbsp;تركيا<br /><strong>الضمان :</strong>&nbsp;5 سنوات ضمان مجاني شامل</p>', '<p>Tornado Air Conditioner 3 HP Cool &amp; Hot Digital With Plasma Inverter</p>', 36000.00, 35810.00, 35810.00, 0, 4.00, 0.00, '2022-10-29 16:36:56', '2023-11-30 14:12:25'),
