(691, NULL, 'تكييف فريش سمارت 2.25 حصان بارد ديجيتال انفرتر', 'Fresh Edge Air Conditioner 2.25 HP Cool Digital Inverter', '<p>يتميز تكييف فريش بالعديد من الخصائص الرائعة مثل خاصية&nbsp;<strong>التتبع</strong>&nbsp;التي تعمل على وجود سينسور بالريموت مما يتيح له قياس درجه الحراره المحيطه للريموت و ارسالها الي التكييف ليقوم بضبط أفضل درجة تبريد للمكان.</p><p>تكييف فريش بيوفر لك الراحة فى الاستخدام والتحكم وذلك عن طريق وجود خاصية&nbsp;<strong>WiFi&nbsp;</strong><br />استمتع أيضاً بخاصية&nbsp;<strong>التشغيل الاقتصادي عند النوم</strong>&nbsp;التي تقوم بتوفير أكبر قدر من الطاقة و اعطاء اكبر قدر من الراحة أثناء النوم.<br />يتميز هذا التتكييف من فريش بخاصية&nbsp;<strong>الانفرتر</strong>&nbsp;التي تعمل على توفير استهلاك الطاقة بنسبة تصل الى 50%.<br />يتميز هذا التكييف من فريش بفريون&nbsp;<strong>R410A&nbsp;&nbsp;</strong>وهو فريون صديق للبيئة.<br />أحد خصائص تكييف فريش الأخري الرائعه أنه يعمل على<strong>&nbsp;اقل ضغط للكهرباء</strong>&nbsp;مما يوفر فى استهلاك الكهرباء بصورة كبيرة للغاية وهي أحد أكبر مميزات تكييفات فريش.<br />اشتري تكييف فريش للحصول على جو بارد ورائع للتغلب على حر الصيف</p>', '<p>Fresh Edge Air Conditioner 2.25 HP Cool Digital Inverter</p>', 35000.00, 33579.00, 33579.00, 0, 15.00, 0.00, '2022-11-06 07:45:44', '2023-12-02 11:17:41'),
