(776, '12-02-231676216661215241504.jpg', 'علبة حجر بسكوتة 4.5 بوصة 50 قطعة EACD211550', '4.5 inch cookie cutter box of 50 pieces', '<p>50 قطعة / المجموعة 115 مم (4 / 1/2 بوصة &times; 1.2 ملم (3/64 بوصة) &times; 22 .2 مم (7/8 بوصة) مركز مسطح قرص قطع للمعدن</p>', '<p>50pcs/set<br />115MM(4/<br />1/2&rdquo;X1.2MM(3/64&rdquo;)X22<br />.2MM(7/8&quot;)<br />Flat centre<br />Cutting disc for metal<br />&nbsp;</p>', 850.00, 777.92, 598.40, 0, 0.00, 0.00, '2023-02-12 15:44:21', '2023-12-31 14:26:07'),
