(790, '13-02-2316762828181843244038.jpg', 'طقم كومبو دريل 2/1 + \"شنيور 20 فولت 2 امبير + 2 بطارية + شاحن + شنطة قماش ECKL2007', 'Combo drill set 1/2 + drill 20 volt 2 amp + 2 batteries + charger + cloth bag', '<p>مع 1 قطعة مثقاب لاسلكي ليثيوم أيون (ECDL620011）<br />مع 1 قطعة مفتاح ربط تأثير ليثيوم أيون (ECDLIW20221)<br />مفتاح ربط صدمات ليثيوم أيون (ECDLIW20221):<br />فرش السيارات<br />محرك مربع: 1/2 &quot;<br />سرعة عدم التحميل: 0-1300 / 0-2100 دورة في الدقيقة<br />معدل التأثير: 0-2000 / 0-3300 / دقيقة<br />العزم الأقصى: 300 نيوتن متر<br />المثقاب اللاسلكي الليثيوم أيون (ECDL620011):<br />سرعة عدم التحميل: 0-400 / 0-1500 دورة في الدقيقة<br />العزم الأقصى: 45 ​​نيوتن متر<br />قدرة تشاك: 0.8-10 مم<br />إعدادات عزم الدوران: 15 + 1<br />ترس ميكانيكي 2 سرعات<br />فولتات الشحن: 220-240 فولت ~ 50/60 هرتز<br />مع حزمة بطارية 2pcs 2.0Ah EBPK20011<br />مع شاحن 1 قطعة EFCR20200<br />مع مقابس 3 قطعة (17 19 21 مم)<br />معبأة في كيس قماش</p>', '<p>With 1pcs lithium-ion cordless drill(ECDL620011）<br />With 1pcs lithium-ion impact wrench (ECDLIW20221)<br />Lithium-ion impact wrench (ECDLIW20221):<br />Brushless motor<br />Square drive: 1/2&quot;<br />No-load speed: 0-1300/0-2100rpm<br />Impact rate: 0-2000/0-3300/min<br />Max torque: 300N.M<br />Lithium-ion cordless drill (ECDL620011):<br />No-load speed: 0-400/0-1500rpm<br />Max torque: 45N.M<br />Chuck capacity: 0.8-10mm<br />Torque settings: 15+1<br />Mechanical 2-speed gear<br />Charge volts: 220-240V~50/60Hz<br />With 2pcs 2.0Ah battery pack（EBPK20011）<br />With 1pcs charger（EFCR20200）<br />With 3pcs sockets (17 19 21mm)<br />Packed by canvas bag</p>', 5500.00, 5124.02, 4455.67, 6, 38.00, 0.00, '2023-02-13 10:06:58', '2024-01-01 10:29:32'),
