(852, '01-06-2316856098121113126429.jpg', 'ماكينة تسوية اسوار شجر بنزين 1 حصان 25.4 سيسي EHTC2611', 'Gasoline fence trimmer, 1 HP, 25.4 CC, EHTC2611', '<p>الطاقة المقدرة: 0.75Kw （1HP）<br />معدل عدم التحميل / السرعة المقدرة: 10000 / دقيقة<br />قطر القطع: 26mm-28mm<br />سعة خزان الوقود: 550 مل<br />محرك قوي ثنائي الأشواط<br />أقصى قطر للقطع: 550 مم<br />معبأة بواسطة مربع اللون</p>', '<p><br />Rated power:0.75Kw（1HP）<br />No-load/rated speed:10000/min<br />Cutting diameter: 26mm-28mm<br />Fuel tank capacity:550ml<br />Powerful 2-stroke motor<br />Max cutting diameter:550mm<br />Packed by color box</p>', 7000.00, 6444.53, 4957.33, 16, 7.00, 0.00, '2023-06-01 08:56:52', '2023-11-19 14:02:36'),
(853, '01-06-23168561085738114617.jpg', 'منشار شجر بنزين 18 بوصة 46 سي سي EGCS18451', '18 inch 46cc Gasoline Chainsaw EGCS18451', '<p>الطاقة المقدرة: 1.8Kw<br />سرعة تباطؤ المحرك: 3100 &plusmn; 300 دورة في الدقيقة<br />الأعلى. قطر القطع: 445 مم (18 بوصة)<br />سعة خزان الوقود: 550 مل<br />سعة خزان الزيت: 260 مل<br />محرك قوي ثنائي الأشواط<br />منشار سلسلة 18 بوصة<br />معبأة بواسطة مربع اللون</p>', '<p>Rated power:1.8Kw<br />Engine idle speed:3100&plusmn;300rpm<br />Max. cutting diameter:445mm(18&quot;)<br />Fuel tank capacity:550ml<br />Oil tank capacity:260ml<br />Powerful 2-stroke motor<br />18&quot; chain saw<br />Packed by color box</p>', 5300.00, 5141.94, 3955.34, 20, 6.00, 0.00, '2023-06-01 09:14:17', '2023-12-31 11:25:18'),
(854, '01-06-2316856115362010215481.jpg', 'كاتينة منشار شجر 18 بوصة ECSL5181', '18-inch sawmill, ECSL5181', '<p>سلسلة منشار 18 بوصة<br />مناسب لمنشار سلسلة البنزين EGCS18451<br />معبأة بواسطة نفطة مزدوجة</p>', '<p>18&quot; Saw chain<br />Suitable for EGCS18451 &nbsp;gasoline chain saw<br />Packed by double blister</p>', 600.00, 556.30, 427.92, 20, 0.00, 0.00, '2023-06-01 09:25:37', '2023-12-31 11:27:02'),
(855, '01-06-23168561278011557310.jpg', 'بار منشار شجر 18 بوصة ECSB6181', '18\" Woodworking Saw Bar ECSB6181', '<p>18 بوصة شريط المنشار<br />مناسب لمنشار سلسلة البنزين EGCS18451<br />معبأة بواسطة نفطة مزدوجة</p>', '<p>18&quot; Chain Saw Bar<br />Suitable for EGCS18451 gasoline chain saw<br />Packed by double blister</p>', 600.00, 543.02, 417.71, 19, 2.00, 0.00, '2023-06-01 09:46:20', '2023-12-31 11:28:10'),
(856, '01-06-231685613104610473250.jpg', 'موتور جلخ 6 بوصة 150 وات EBGR61501', '6-inch 150-watt grinding motor EBGR61501', '<p>240 فولت ~ 50 هرتز<br />مدخلات الطاقة: 150 واط<br />سرعة عدم التحميل: 2950 دورة في الدقيقة<br />مقاس العجلة: 150 مم<br />راحة عمل قابلة للتعديل<br />قاعدة ألومنيوم شديدة التحمل<br />تشمل مجموعة واحدة من واقيات العين<br />تشمل صندوق تخزين أداة 1 قطعة<br />معبأة في علبة كرتون</p>', '<p>240V~50Hz<br />Input power:150W<br />No-load speed:2950rpm<br />Wheel size:150mm<br />Adjustable work rest<br />Heavy duty aluminum base<br />Include 1set eye shields<br />Include 1pcs tool storage box<br />Packed by carton box</p>', 1450.00, 1308.11, 1137.49, 18, 12.00, 0.00, '2023-06-01 09:50:03', '2023-12-30 12:22:28'),
