(916, '10-10-231696943010851901368.jpg', 'حامل ميزان ليزر مع ميزان ليزر 5 خط ضوء احمر', 'Laser scale holder with 5 red light line laser scale', '<p>&lt;3 ثانية نطاق التسوية الذاتية &le;3 &deg; نوع الليزر: أحمر فئة الليزر 3R ， &lt;5 ميجا واط بدون حوامل ثلاثية القوائم ، تطابقنطاق العمل: 0 ~ 30 م 1 خط أفقي و 4 خطوط عمودية دقة التسوية: &plusmn; 1.0 مم عند 5 م دقة الخط &plusmn; 1.5 مم عند 5 م وقت التسوية مع حوامل ETPD12001 مع وظيفة القفل المتقاطع مع وظيفة اكتساب الليزر درجة حرارة التشغيل 0 ~ + 40 درجة مئوية درجة حرارة التخزين -20 ~ + 70 درجة مئوية بطاريات AA (1.5 فولت) * 4 بطارية قلوية متضمنة الوزن بدون بطاريات 980 جرام معبأة بصندوق بلاستيكي</p><p>خيط 5/8 &quot;و 1/4&quot; 1.2 متر ترايبود ألومنيوم مناسب لـ ESLE21501 、 ESLE53001 معبأة حسب التسمية</p>', '<p>&lt;3s Self-leveling range &le;3&deg; Laser type: Red Laser Class 3R，&lt;5mW Without tripods, match Working range: 0~30m 1 horizontal line and 4 vertical lines Leveling accuracy: &plusmn;1.0mm at 5m accuracy Line &plusmn;1.5mm at 5m Leveling time With holders ETPD12001 With cross-lock function With laser acquisition function Operating temperature 0 ~ +40&deg;C Storage temperature -20 ~ +70&deg;C AA batteries (1.5V) *4 Alkaline battery included Weight without batteries 980 grams Packed in a plastic box</p>', 3994.00, 3499.00, 3499.00, 9, 4.00, 0.00, '2023-10-10 13:03:30', '2023-11-27 19:47:13'),
(917, '18-10-2316976263521288972177.jpg', 'مجموعة من المفك مزوجة الجانبين 8 قطع من إيمتوب EDES10801', 'EMTOP EDES10801 Double open end spanner set, 8 pieces', '<ul><li>مجموعة من المفك مزدوجة الجانبين 8 قطع من إيمتوب</li><li>مصنوعة من مواد عالية المتانة والجودة</li><li>متعددة الاستخدامات مثالية للإصلاحات البسيطة والصيانة في المنزل</li><li>مناسبة لتجميع الأثاث والألعاب وحوامل التلفزيون</li><li>الحجم: 6-22 ملم</li><li>مصقول بشكل جيد</li></ul>', '<ul><li>Emtop 8-Piece Double Sided Screwdriver Set</li><li>Made of highly durable and quality materials</li><li>Versatile Ideal for simple repairs and maintenance around the home</li><li>Suitable for assembling furniture, toys and TV stands</li><li>Size: 6-22 mm</li><li>Well polished</li></ul>', 450.00, 349.54, 268.88, 10, 0.00, 0.00, '2023-10-18 10:52:33', '2023-11-23 11:43:51'),
(918, '19-10-2316977099552115345284.jpg', 'مفتاح فرنساوي 12\" معدني EMTOP Adjustable wrench 300mm 12r EAWH131222', 'EMTOP Adjustable wrench 300mm 12r EAWH131222', '<p>يعد مفتاح الربط الفرنسي القابل للتعديل Emtop Industrial Satin مقاس 12 بوصة أداة أساسية لأي محترف أو متحمس للأعمال اليدوية. بطول 300 ملم، يعد هذا المفتاح الفرنسي من ماركة امتوب، موديل EAWH131222، مثاليًا لأعمال التعديل والشد في المساحات الصغيرة أو التي يصعب الوصول إليها. لا يمنحها تشطيب الساتان مظهرًا أنيقًا فحسب، بل يوفر أيضًا مقاومة أكبر للتآكل والتآكل. مصنوع من الفولاذ عالي الجودة، يضمن هذا المفتاح متانة ومقاومة استثنائية، مما يسمح لك بتنفيذ عملك بثقة تامة. يتيح لك تصميمها القابل للتعديل العمل مع مجموعة واسعة من أحجام الصواميل والمسامير، مما يجعلها أداة متعددة الاستخدامات وعملية. مع مفتاح الربط الفرنسي القابل للتعديل مقاس 12 بوصة من Emtop Industrial Satin، سيكون لديك الأداة المثالية لأي مهمة.</p>', '<p>The Emtop Industrial Satin 12&#39;&#39; Adjustable French Wrench is an essential tool for any professional or DIY enthusiast. With a length of 300 mm, this French wrench from the Emtop brand, model EAWH131222, is perfect for adjustment and tightening work in small or difficult-to-access spaces. Its satin finish not only gives it an elegant look, but also provides greater resistance to wear and corrosion. Made of high quality steel, this wrench guarantees exceptional durability and resistance, allowing you to carry out your work with complete confidence. Its adjustable design allows you to work with a wide variety of nut and bolt sizes, making it a versatile and practical tool. With the Emtop Industrial Satin 12&#39;&#39; Adjustable French Wrench, you will have the perfect tool for any task.</p>', 350.00, 262.72, 202.09, 40, 0.00, 0.00, '2023-10-19 10:05:55', '2023-11-23 11:08:54'),
(919, '23-10-2316980663662012191181.jpg', 'شنطة عدة خدمة شاقة 24 بوصة  حموله 25 كيلو ETBG28242', 'Heavy-duty tool bag, 24 inches, load capacity 25 kg', '<p>الحجم: 24&quot; الحمولة القصوى: 25 كجم الحجم (الطول * العرض * الارتفاع): 60*23*35 سم إطار متين لسهولة الفتح والوصول قاعدة بلاستيكية معززة من أجل المتانة جيوب داخلية لسعة تخزين إضافية حزام كتف قابل للتعديل متضمن معبأة بواسطة بطاقة ورقية</p>', '<p>Size:24&quot;<br />Max load:25kg<br />Size(L*W*H):60*23*35cm<br />Rigid frame for easy opening and access<br />Reinforced plastic base for durability<br />Internal pockets for additional storage capacity<br />Adjustable shoulder strap included<br />Packed by paper card<br />&nbsp;</p>', 1450.00, 1292.49, 994.22, 30, 0.00, 0.00, '2023-10-23 13:06:07', '2023-11-23 14:03:49'),
(920, '04-11-2316990932572076252106.jpg', 'صنفرة حوائط 9 بوصه EDSD10501   1050 watt', 'Drywall Sander9 inch 1050 watt  EDSD10501', '<p>الجهد: 220-240 فولت ~ 50/60 هرتز طاقة الإدخال: 1050 واط سرعة عدم التحميل: 600-2300 دورة في الدقيقة قطر وسادة الطحن: 215 ملم قطر ورق الصنفرة: 225 مم قطر الأنبوب: 32 ملم قطر خرطوم الغبار: 38 ملم ضوء العمل المتكامل مع 12 قطعة من ورق الصنفرة مع محولات اتصال 3 قطعة مع أنبوب مرن بطول 2 متر مع شريط تمديد 1 قطعة مع 1 قطعة كيس لجميع الغبار مع مجموعة واحدة من فرش الكربون الإضافية</p>', '<p>&nbsp;</p><p>Voltage:220-240V~50/60Hz Input power:1050W No-load speed:600-2300rpm Grinding pad diameter:215mm Sanding paper diameter:225mm Tube diameter:32mm Dust hose diameter:38mm Integrated work light With 12pcs sanding papers With 3pcs connection adapters With 2m flexible pipe With 1pcs extension bar With 1pcs dust bag With 1set extra carbon brushes</p>', 4500.00, 4272.61, 3715.31, 9, 41.00, 0.00, '2023-11-04 10:19:48', '2023-12-30 11:59:37'),
(921, '06-11-2316992691591618229915.jpg', 'شنيور 12 فولت 1 بطارية تايب سي ( type c - usb ) - ECDL12510', 'Lithium-Ion cordless drill 12 VOLT   ECDL12510', '<p>الجهد: 12 فولت سرعة عدم التحميل: 0-750 دورة في الدقيقة أقصى عزم دوران: 20 نيوتن متر تشاك من البلاستيك سعة الظرف: 0.8-10 ملم إعدادات عزم الدوران: 15+1 ضوء عمل LED مدمج مؤشر طاقة البطارية LED يشمل: 2 قطعة لقم Cr-V مقاس 65 مم 1 قطعة بطارية 1.5 أمبير (EBPK12153) منفذ شحن البطارية: USB من النوع C يُباع الشاحن بشكل منفصل</p>', '<p>&nbsp;</p><p>Voltage: 12V No-load speed: 0-750rpm Max torque: 20Nm Plastic chuck Chuck capacity: 0.8-10mm Torque settings: 15+1 Integrated LED work light LED battery power indicator Include: 2 Pcs Cr-V 65mm bits 1 Pcs 1.5Ah battery pack(EBPK12153) Battery charging port: USB type-C Charger sold separately</p>', 900.00, 854.21, 742.79, 9, 4.00, 0.00, '2023-11-06 11:12:39', '2023-12-28 13:00:56'),
