(960, '07-12-2317019509082127539745.jpg', 'كمبروسر هواء 500 لتر 7.5 حصان سير اندكشن موتور ملفات نحاس -  EACPB75503', 'Air compressor  500 liters 7.5 HP belt induction motor copper coils - EACPB75503', '<p>الجهد: 380 فولت ~ 50 هرتز المرحلة: ثلاثة الطاقة المدخلة: 5.5 كيلو واط (7.5 حصان) الخزان: 500 لتر (131 جالون) الضوضاء: 83 ديسيبل وعد مدى الحياة 3000 ساعة نظام قيادة الحزام المضخة مشحمة بالزيت محرك حثي من الأسلاك النحاسية ضغط التشغيل: max.8bar معبأة بواسطة علبة خشبية</p>', '<p>Voltage:380V~50Hz<br />Phase:Three<br />Input power: 5.5kW (7.5HP)&nbsp;<br />Tank:500L(131Gal)<br />Noise:83db<br />3000Hr lifetime promise<br />Belt driving system<br />Pump lubricated with oil<br />Copper wire induction motor<br />Operation pressure:max.8bar<br />Packed by wooden case</p>', 59000.00, 56234.00, 48899.13, 1, 0.00, 0.00, '2023-12-07 12:08:28', '2023-12-31 10:17:44'),
(961, '09-12-231702116308590916002.jpg', 'جاروف زراعي 340 مللي يد كاوتش EHFTT858', 'Agricultural Trowel  emtop 340 mm  EHFTT858', '<p>الطول: 340 ملم مقبض براءة اختراع التصميم الفريد العرض: 85 ملم السُمك: 1.5 ملم المواد: الكربون الصلب معبأة بواسطة بطاقة ورقية</p>', '<p>length:340mm<br />Unique design patent &nbsp;handle<br />Width:85mm<br />Thickness:1.5mm<br />Material:carbon steel<br />Packed by paper card</p>', 130.00, 92.95, 71.50, 50, 0.00, 0.00, '2023-12-09 10:05:09', '2023-12-09 10:19:19'),
(962, '09-12-231702117066581947886.jpg', 'شوكة زراعية 320 مللي يد كاوتش EHFTF38', 'Agricultural fork  emtop 320 mm EHFTF38', '<p>الطول: 320 ملم مقبض براءة اختراع التصميم الفريد العرض: 80 ملم السُمك: 2.5 ملم المواد: الكربون الصلب معبأة بواسطة بطاقة ورقية</p>', '<p>length:320mm<br />Unique design patent &nbsp;handle<br />Width:80mm<br />Thickness:2.5mm<br />Material:carbon steel<br />Packed by paper card</p>', 130.00, 92.95, 71.50, 50, 2.00, 0.00, '2023-12-09 10:17:46', '2024-01-01 06:58:47');
