INSERT INTO `settings` (`id`, `name`, `description`, `tagged`, `copyrigth`, `about_ar`, `about_en`, `policy_ar`, `why_us_ar`, `why_us_en`, `tax_rate`, `dilivary`, `email`, `phone`, `created_at`, `updated_at`) VALUES
(1, 'Gado Store', NULL, NULL, 'Gado', ' <p>\n                             سياسة التوصيل: \nيتنم توصيل الطلب في غضون ٢-٥ أيام من وقت الطلب \nسياسة الاسترجاع: \nيحق للعميل استرجاع المنتج في خلال ١٤ يوم بشرط * ظهور عيب صناعه بالمنتج في اول ١٤ يوم يحق العميل الاستبدال او الاسترجاع، بشرط توافر الفاتورة وكل مشتملاته والمنتج بحالته بدون اي اضرار\n\n\nنقبل الدفع ببطاقات فيزا، ماستر كارت وكروت ميزا\n\nالشروط والاحكام\nتنص شروط الاستخدام هذه وجميع السياسات والشروط الإضافية (في حال تطبيقها الموجودة على الموقع على الشروط التي تقدمها لك للدخول إلى واستخدام الموقع والخدمات والتطبيقات، بما في ذلك تطبيق الهاتف الجوال الخاصة بنا ويُشار إليها مجتمعة بـ \"الخدمات \" ) \n\n\nحال وصولك و/ أو تسجيلك و/ أو استمرارك في استخدام الخدمات أو الوصول إليها، فأنت توافق على الالتزام بشروط الاستخدام هذه والوثائق القانونية بأثر فوري\n\nيشير إلى أي معلومات تحدد أو يمكن استخدامها لتحديد هوية الشخص الذي تتعلق به هذه المعلومات أو الاتصال به أو تحديد موقعه، بما في ذلك، على سبيل المثال لا الحصر، الاسم والعنوان ورقم الهاتف ورقم الفاكس وعنوان البريد الإلكتروني ولا تتضمن معلومات التعريف الشخصية المعلومات التي يتم جمعها بشكل مجهول أي بدون تحديد هوية المستخدم الفردي) \n\nكيف يستخدم الموقع معلومات التعريف الشخصية؟ نحن نستخدم معلومات التعريف الشخصية لتخصيص الموقع، وتقديم عروض الخدمة المناسبة، وتلبية طلبات البيع والشراء على الموقع. قد نرسل بريدًا إلكترونيا إلى الزوار والعملاء المعتمدين حول فرص البحث أو الشراء والبيع على الموقع أو المعلومات المتعلقة بموضوع الموقع. يجوز لنا أيضًا استخدام معلومات التعريف الشخصية للاتصال بالزوار والعملاء المعتمدين ردا على استفسارات محددة، أو لتقديم المعلومات المطلوبة\n\n\nكيف يحافظ الموقع على معلومات التعريف الشخصية آمنة؟ جميع موظفينا على دراية بسياستنا وممارساتنا الأمنية لا يمكن الوصول إلى معلومات التعريف الشخصية لزوارنا وعملائنا المعتمدين \n\n كما ان أرقام بطاقات الائتمان أو أرقام الضمان الاجتماعي، محمية بواسطة بروتوكولات التشفير الموضوعة لحماية المعلومات المرسلة عبر الإنترنت.\n\nفي حين أننا نتخذ تدابير معقولة تجاريا للحفاظ على موقع أمن، فإن الاتصالات الإلكترونية وقواعد البيانات تكون عرضة للأخطاء والتلاعب والاقتحامات، ولا يمكننا أن نضمن أو نضمن عدم حدوث مثل هذه الأحداث ولن نكون مسؤولين تجاه الزوار أو العملاء المعتمدون لأية حوادث من هذا القبيل.\n\nان شروط الاستخدام هذه والوثائق القانونية خاضعة للتعديل من قبلنا في اي وقت. إن استمرار استخدامك للموقع بعد نشر أي تغيير يعني موافقتك على شروط الاستخدام هذه والوثائق القانونية التي تم تعديلها.\n\nحال وصولك و/ أو تسجيلك و/ أو استمرارك في استخدام الخدمات أو الوصول إليها، فأنت توافق على الالتزام بشروط الاستخدام هذه والوثائق القانونية بأثر فوري\n\n                        </p>', '<p>\r\n                                 These Terms of Use and all additional policies and terms (if applicable) therein\r\n                                 The website is based on the terms that we provide to you for accessing and using the website, services and applications, including\r\n                                 In our mobile application (collectively referred to as the “Services”) these are included\r\n                                 Legal documents by reference in these Terms of Use\r\n                             </p>\r\n                             <p>\r\n                                 Once you access, register, and/or continue to use or access the Services, you agree\r\n                                 You must comply with these Terms of Use and the Legal Documents with immediate effect\r\n\r\n                             </p>\r\n                             <p>\r\n                                 These terms of use and legal documents are subject to modification by us at any time. that\r\n                                 Your continued use of the site following the posting of any change will mean your acceptance of these terms of use\r\n                                 And legal documents that have been amended.\r\n                             </p>\r\n                             <h4>About the site</h4>\r\n                             <p>\r\n                                 These Terms of Use and all additional policies and terms (if applicable) therein\r\n                                 The website is based on the terms that we provide to you for accessing and using the website, services and applications, including\r\n                                 In our mobile application (collectively referred to as the “Services”) these are included\r\n                                 Legal documents by reference in these Terms of Use\r\n                             </p>\r\n                             <p>\r\n                                 Once you access, register, and/or continue to use or access the Services, you agree\r\n                                 You must comply with these Terms of Use and the Legal Documents with immediate effect\r\n\r\n                             </p>\r\n                             <p>\r\n                                 These terms of use and legal documents are subject to modification by us at any time. that\r\n                                 Your continued use of the site following the posting of any change will mean your acceptance of these terms of use\r\n                                 And legal documents that have been amended.\r\n                             </p>\r\n\r\n                             <h4>Registration conditions</h4>\r\n                             <p>\r\n                                 These Terms of Use and all additional policies and terms (if applicable) therein\r\n                                 The website is based on the terms that we provide to you for accessing and using the website, services and applications, including\r\n                                 In our mobile application (collectively referred to as the “Services”) these are included\r\n                                 Legal documents by reference in these Terms of Use\r\n                             </p>\r\n                             <p>\r\n                                 Once you access, register, and/or continue to use or access the Services, you agree\r\n                                 You must comply with these Terms of Use and the Legal Documents with immediate effect\r\n<p>\r\n\r\nReturn policy\r\n<p>\r\nThe customer has the right to return the product within 14 days\r\non condition\r\nIf a manufacturing defect appears in the product within the first 14 days, the customer has the right to exchange or return, provided that the invoice and all its components are available and the product is in its condition without any damages.\r\n                             </p>\r\n                             <p>\r\n                                 These terms of use and legal documents are subject to modification by us at any time. that\r\n                                 Your continued use of the site following the posting of any change will mean your acceptance of these terms of use\r\n                                 And legal documents that have been amended.\r\n                             </p>', NULL, '<p>تضم جادو جروب مجموعة من الشركات المصرية العاملة في مجالات مختلفة وهي:</p><p>1- جادو كول: - للتكييف والتجارة وهى موزع معتمد لشركات التكييف المحلية والعالمية. منذ إنشائها في عام 2014 ، لقد حققت الشركة وبشكل ملحوظ مكانة ثابتة كمركز<br /><br />محلي رائد في مجال HVAC. باستمرار تقديم منتجات ذات مستوى عالمي لعملائها وذلك من خلال الابتكار والبحث مع مراعاة الجودة والسلامة. موظفينا على أعلى مستوى ولفهم أن الشركات المملوكة محليًا تبني مجتمعات قوية من خلال الحفاظ على سلالاتنا وقيمنا التقليدية وتنميتها في العالم الحديث.</p><p>2-جادو تولز: - للعدد والأدوات اليدوية والكهربائية. يشرفنا أن نعلن أننا أصبحنا الوكيل الحصري لشركة EMTOP International في مصر. إنها شركة عالمية لها العديد من الفروع في مختلف دول العالم (اليابان - سنغافورة - فنزويلا - تشيلي - كوستاريكا - الأرجنتين - ألبانيا - الأردن - ليبيا - وأكثر من ذلك بكثير) تكرس شركة Emtop جهودها لإنشاء الأدوات الأكثر فعالية من حيث التكلفة: الأدوات اليدوية ، ومصادر الطاقة ، والأدوات الكهربائية ، والملحقات الأخرى، ونحن نركز على الجودة العالية وبأفضل الأسعار التنافسية. مهمتنا هي جلب أفضل الأدوات لعملك الخاص، لنكون معك.</p>', '<p>Gado Group includes a group of Egyptian companies working in different fields, namely:</p><p>1- Gado Cool:- For Air Conditioning and Trade, it is an authorized distributor for local and international air conditioning companies. Since its establishment in 2014, Gado Cool has remarkably achieved a firm position as a premier HVAC leading local. continuously delivering world-class products for its client through constant innovation and extensive research while considering quality and valuing safety. our people to the highest standard and understanding that locally-owned businesses build strong communities by sustaining and cultivating our traditional lineage and values in the modern world.</p><p>2-Gado Tools:- for tools, hand, and electrical tools. is honored to announce that we have become an exclusive agent for EMTOP International in Egypt. It is a global company with many branches in different countries of the world (Japan - Singapore - Venezuela - Chile - Costa Rica - Argentina - Albania - Jordan - Libya - and much more) Emtop dedicates to creating the most cost-effective full-range tools: hand tools, power sources, power tools, and accessories, we are focusing on top quality but at the most competitive price. Our mission is to bring top tools to your work, To be with you. We believe that we can make difference, and make it easier</p>', 0.00, 50.00, 'omarkapo501@yahoo.com', '+201151263677', '2022-08-07 07:55:58', '2023-10-13 17:56:55');
